insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (28,27,'\n<p>Да, было что в прудике половить. Я там на щуках тренировался часто, а народ полавливал леща у плотины. Рыба пахла сильно, сам не брал, если только соседям, если просили.</p>','location',771,NULL,NULL,NULL,NULL,115,115,'2011-10-17 06:18:21','2011-10-17 06:18:21',20,13,14,4);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (29,NULL,'root','location',772,NULL,NULL,NULL,NULL,189,189,'2011-10-18 20:16:45','2011-10-18 20:16:45',29,1,8,0);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (30,29,'\n<p>В пруду карась, ротан... были раньше, сейчас не знаю.</p>','location',772,NULL,NULL,NULL,NULL,268,268,'2011-10-19 05:56:45','2011-10-19 05:56:45',29,2,3,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (31,29,'\n<p>ловился неплохой карасик и карпик щуку там когда это озеро открыли дачники купившие там землю ловили я с батей не фаны спининга по 50 штуков каждый за утро а когда появились профи они по 80 цедили щучка была от 700-2 кило а потом пруд зарыбили и запретили ловить там.был там в 2007 по весне простоял день никазяфки потом увидел мужиков с сетями за ночь один карасик....</p>','location',772,NULL,NULL,NULL,NULL,148,148,'2011-10-21 10:29:27','2011-10-21 10:29:27',29,4,5,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (32,29,'\n<p>Осенью 2008 за час или чуть меньше на двоих поймали три окуня на спин. Ловили прямо с дамбы. Но мы на рыбу особо не расчитывали. Ездили просто посмотреть что за место. Да и мне охото было свой новый воблер испытать.</p>','location',772,NULL,NULL,NULL,NULL,293,293,'2011-10-20 12:40:28','2011-10-20 12:40:28',29,6,7,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (33,NULL,'root','location',773,NULL,NULL,NULL,NULL,146,146,'2011-09-24 17:04:14','2011-09-24 17:04:14',33,1,14,0);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (34,33,'\n<p>Кто-нибудь знает как сейчас здесь дела. Народу много сидит, вроде подлещик иногда попадается. Поподробнее подскажите..</p>','location',773,NULL,NULL,NULL,NULL,303,303,'2011-10-15 17:01:02','2011-10-15 17:01:02',33,2,3,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (35,33,'\n<p><span>был сегодня. В 8 утра было уже человек 50. Потом еще около сотни подтянулось. Клевало отвратительно. Народ чкался в разные стороны и почти безрезультатно. После обеда вроде подлещик стал проклёвываться. Лично у меня почти все поклевки были в основном плотва. Итог:&nbsp;</span><span>&nbsp;около десятка плотвичек и 2 подлещика. Половина рыбы в черных точках.</span></p>','location',773,NULL,NULL,NULL,NULL,303,303,'2011-10-14 09:22:20','2011-10-14 09:22:20',33,4,5,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (36,33,'\n<p>был в минувшее воскресенье на этом озере, народу прилично и вроде как под вечер начал этот самый подлец проклёвывать.Мой результат 18 шт. почти все с ладонь, попадаются и побольше, но уже с большим кол-вом точек, не приятно даже в руки брать!!!!!!!!!!</p>','location',773,NULL,NULL,NULL,NULL,305,305,'2011-10-10 05:17:08','2011-10-10 05:17:08',33,6,11,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (38,36,'\n<p><span>Все&nbsp; верно, в точках(хотя они и не вредные)ловить не особо приятно, разве что спортивный интересс, сам живу в нескольких км от Остроженского, но уже лет десять туда зимой не езжу.Подлещик там (мое мнение) переродился и больше 100=-150 гр не вырастает&nbsp;</span><span>Хотя могет быть я не прав.</span></p>','location',773,NULL,NULL,NULL,NULL,169,169,'2011-10-19 14:26:02','2011-10-19 14:26:02',33,9,10,2);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (39,33,'\n<p>В прошлое воскресенье ровно 5 штук (1 подлещик). Рыба стала попадаться совсем мелкая.</p>','location',773,NULL,NULL,NULL,NULL,150,150,'2011-10-04 14:25:20','2011-10-04 14:25:20',33,12,13,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (40,NULL,'root','location',471,NULL,NULL,NULL,NULL,220,220,'2011-08-11 21:12:31','2011-08-11 21:12:31',40,1,14,0);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (41,40,'\n<p><span>Однажды я тут очень удачно поблеснил, ну, по моим меркам конечно </span><img src=\"http://www.fishpro.org/forum/Smileys/classic/grin.gif\" alt=\":grin:\" title=\"grin\"><span>, не щуку так окуня...</span></p>','location',471,NULL,NULL,NULL,NULL,132,132,'2011-09-09 19:34:30','2011-09-09 19:34:30',40,2,3,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (42,40,'\n<p>Окунь и плотва клюют слабо. Осталась недоловленная форель. На жерлицу ловяца щупачки. Ценник - 200р (путевка действительна на все пруды ПРООиР). Аэрация более чем хорошая - огоромная мана с двумя аэраторами.</p>','location',471,NULL,NULL,NULL,NULL,301,301,'2011-09-13 03:12:54','2011-09-13 03:12:54',40,4,9,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (43,42,'\n<p>200 р за верхний и нижний пруд, а на интенсивный вроде как не пускают...??? А форель именно там, или я отстал от жизни?</p>','location',471,NULL,NULL,NULL,NULL,132,132,'2011-09-22 19:53:31','2011-09-22 19:53:31',40,5,8,2);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (44,43,'\n<p>Ловят&nbsp; в верхнем пруду. В интенсивном ловить некого. Форель в верхнем. Путевки дают на льду.</p>','location',471,NULL,NULL,NULL,NULL,208,208,'2011-10-19 02:51:16','2011-10-19 02:51:16',40,6,7,3);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (46,40,'\n<p><span>Сегодня.&nbsp;</span>С 14.00 и до темна. &nbsp;Ловля форели, на блесну и на креветку.&nbsp;Блесны не работали, покидал даже спин в промоины от аэратора, но увы.&nbsp;Креветка, на стоячку, дала 3 поклевки, две мимо сразу, третья&nbsp; - подержал пол секунды и сошла. Плотва с палец у мужиков клевала неплохо.</p>','location',471,NULL,NULL,NULL,NULL,132,132,'2011-10-09 21:42:04','2011-10-09 21:42:04',40,12,13,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (47,NULL,'root','location',774,NULL,NULL,NULL,NULL,274,274,'2011-08-09 19:31:23','2011-08-09 19:31:23',47,1,4,0);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (48,47,'\n<p><span>Заезжал посмотреть.&nbsp;</span>Карась на солнце грелся - при подходе к берегу начал выпрыгивать из воды</p>','location',774,NULL,NULL,NULL,NULL,184,184,'2011-09-24 19:12:28','2011-09-24 19:12:28',47,2,3,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (49,NULL,'root','location',775,NULL,NULL,NULL,NULL,122,122,'2011-07-27 20:38:47','2011-07-27 20:38:47',49,1,4,0);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (50,49,'\n<p><span>Кто нибудь владеет инфой, как там сейчас с клевом окуня и щучки на спин,</span><span>&nbsp;зимой там славно окунь клевал на балду и балансир&nbsp;</span></p>','location',775,NULL,NULL,NULL,NULL,140,140,'2011-09-05 01:48:09','2011-09-05 01:48:09',49,2,3,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (51,NULL,'root','location',777,NULL,NULL,NULL,NULL,165,165,'2011-08-02 07:15:33','2011-08-02 07:15:33',51,1,16,0);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (52,51,'\n<p><span>Ну, прудик там не один &nbsp;</span>Вывез вчера жену за карасиком - любит она это дело&nbsp;Пока искали места его стоянок , пока он начинал расклевываться - было интересно . Но когда начался промысел - сразу надоело .&nbsp;Забрали домой с десяток грамм по 100-120 ( больше он там не вырастает ) , остальные грамм по 70 ( не считал сколько ) . На 4 больших сковородок хватило .</p>','location',777,NULL,NULL,NULL,NULL,198,198,'2011-09-14 16:38:57','2011-09-14 16:38:57',51,2,3,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (54,51,'\n<p><span>Кстати в прошедшую субботу ,при бешенном ветре ,карасик клевал у нас с женой исправно . Меня на&nbsp; 2 часа всего хватило , супруга еще полтора часа удочкой махала . Размер маловат - грамм по 30-50 ( естессна отпущены ) . Домой забрали от 70 до 100 грамм . Получил один бонус - грамм 200 . Таких там ни разу не ловил , да и не слыхал , чтоб ловили .</span>А вот ярко выраженный золотой карась совсем мелкий - см 5 в длину , и , как ни странно , строение тела прогонистое .</p>','location',777,NULL,NULL,NULL,NULL,198,198,'2011-08-28 02:24:28','2011-08-28 02:24:28',51,6,15,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (55,54,'\n<p>А он такой и должен быть настоящий</p>','location',777,NULL,NULL,NULL,NULL,232,232,'2011-09-05 19:22:12','2011-09-05 19:22:12',51,7,14,2);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (56,55,'\n<p><span>Вот уж позволь с тобой не согласиться&nbsp; </span><span>. все золотые от 350 гр. &nbsp;круглые , как блин .</span></p>','location',777,NULL,NULL,NULL,NULL,198,198,'2011-09-26 23:52:24','2011-09-26 23:52:24',51,8,13,3);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (57,56,'\n<p>Круглыми они становятся, когда вырастают, а пока мелкие - прогонистые</p>','location',777,NULL,NULL,NULL,NULL,155,155,'2011-09-29 20:51:01','2011-09-29 20:51:01',51,9,12,4);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (58,57,'\n<p>ну не скажи, на Песочне попадаються стограммовые карасики красные и форма тела у них уже круглая, не говорю про 300 граммовых те уже как сковородки, видимо всетаки форма тела зависит от водоема и кормовой базы. На даче запущенные по весне в ванну караси (упитанные и круглой формы) к осени становились худющими как скелеты и прогонистыми, хотя корм в ванну переодически подкидывался.</p>','location',777,NULL,NULL,NULL,NULL,223,223,'2011-10-06 04:07:06','2011-10-06 04:07:06',51,10,11,5);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (59,NULL,'root','location',778,NULL,NULL,NULL,NULL,91,91,'2011-08-19 03:19:59','2011-08-19 03:19:59',59,1,8,0);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (60,59,'\n<p>На обратном пути, из Максимовки, поехал искать, платник в Хрусталях.Дорога приличный асфальт, местами немного подразбитый. Платник в Хрусталях на самом деле находится не в Хрусталях, а в деревне Рысковщина. Проезжал указатель, что это охотничьи угодья МВД, охраняются милицией. Ну думаю, сейчас увижу приличный по размерам платник, как в Русичах. На месте обнаружился небольшой жабовник, запруда на речушке. Ловить можно только с одного берега, и только поплавочными удочками, иные снасти запрещены.</p>','location',778,NULL,NULL,NULL,NULL,35,35,'2011-10-08 00:53:54','2011-10-08 00:53:54',59,2,5,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (61,59,'\n<p>Действительно есть такой водоем. Знакомые там бывают регулярно. Из представителей ихтиофауны в наличии карп, карась, белый амур. Размер до 3 кг. Пару лет назад ловилась форель.</p>','location',778,NULL,NULL,NULL,NULL,206,206,'2011-09-11 03:06:17','2011-09-11 03:06:17',59,6,7,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (62,60,'\n<p><span>прудик там совсем маленький.. глубина у плотины метра 4 везде мелко. карась там тоже есть.. и каналья-сомик (со слов сторожилы).. по деньгам там совсем как-то не гуманно было.. за каждый, извините, \"пук\" - 50-100р.. даже с тех кто не ловит вообще.. &nbsp;</span>при мне сидело два человека.. часов по 3-4 уже.. ни одной рыбки... только карась-малёк докучал..на указателе написано \"1км\" до пруда... на деле 2,2км и после дождя местами будет на легковой неприятно..</p>','location',778,NULL,NULL,NULL,NULL,274,274,'2011-10-16 13:26:13','2011-10-16 13:26:13',59,3,4,2);
