insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (76,NULL,'root','location',782,NULL,NULL,NULL,NULL,216,216,'2011-10-20 03:46:23','2011-10-20 03:46:23',76,1,4,0);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (77,76,'\n<p><span>Побывал сегодня на этом водоёме.</span>Дорога до Барятино хорошая, за исключением небольшого кусочка в Мосальске. В Барятино перед ж/д переездом поворот направо, 5 километров не очень хорошей дороги и после администрации этого населённого пункта поворот направо и начинается сказка, а не дорога. На повороте стоял УАЗик-автолавка (кстати УАЗ там самая часто встречающаяся машина, во всех типах кузова и комплектациях), водитель автолавки подсказал, что до озера метров 500 и жалобно оглядев мой чистый автомобиль (KIA CEED), сказал \"посадка у вашей машины низковата\", но я его уже не слушал, водоём то через 500 метров.</p>\n<p>Оказалось, что в посёлке прокладывают газопровод, со всеми остатками сего действия, есть поперёк дороги траншеи, где под весом машины грунт проседает, грязи ппц даже пришлось рулём крутить поактивней и подгазовывать, чтоб не встать.&nbsp;Итак водоём, чем то похож на Шелканово, только поуже. На дамбе мужик, подхожу к нему с расспросами \"чё да как?\". Показал он мне штук 6 небольших ротанов и говорит что кроме ротанов есть ещё карась, только он не клюёт, а больше ничего нет, сетками и электричеством всё извели.</p>\n<p>Ну всё рыбалка провалилась, ведь у меня лишь спининг. Но тут мужик говорит, что щука есть&nbsp;в Асмолово, в 15 км от Барятино, а так же подлещик и плотва вроде. Фото водоёма, сажусь в машину, 500 метров жо..&nbsp; ой, дороги и я мчу на щучий водоём.&nbsp;Дорога в Асмолово асфальтная, только разбитая, но мне уже всё равно. И вот я разматываю спининг и понеслось, точнее я по берегу носился со спинингом, кидал в воду всякие железки, силиконки, воблеры и только от них были всплески и круги на воде, более ничто и никто не нарушали водную гладь. Были ещё на озере два лодочника-поплавочника, но у них только ротаны.</p>\n<p>Возвращаясь обратно в Барятино остановился в лесу грибов пособирать и хоть тут удача, за 20 минут набрал пакет подберёзовиков и подосиновиков.</p>\n<p>Резюме: если ехать в ту сторону, надо ехать в Милятино.</p>\n<p>Всем удачи!</p>','location',782,NULL,NULL,NULL,NULL,35,35,'2011-10-21 16:02:47','2011-10-21 16:02:47',76,2,3,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (78,NULL,'root','location',783,NULL,NULL,NULL,NULL,120,120,'2011-09-02 03:58:27','2011-09-02 03:58:27',78,1,6,0);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (79,78,'\n<p><span>Вчера вечером ездил смотрел данный водоём. Находится он по дороге на тулу между Хотисино и Макарово. Потрещал с егерем. Он оказался достаточно адекватным и ТРЕЗВЫМ(??). Правда, на все вопросы отвечал : \"посмотите . попробуйте...\". Сам водоём понравился. Рыбка достаточно крупная плескалась. Похоже карп. на берегу сделано несколько беседок. Местные говорят, что хорошо ловиться карп (500-700г и больше), карась. Больше никакой рыбы там нет.&nbsp;</span>&nbsp;Если кто там был - напишите , плж.</p>','location',783,NULL,NULL,NULL,NULL,303,303,'2011-10-03 08:35:50','2011-10-03 08:35:50',78,2,3,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (80,78,'\n<p>Ну что, ловил там кто-нибудь или нет?&nbsp; Отпишитесь, пожалуйста.</p>','location',783,NULL,NULL,NULL,NULL,61,61,'2011-09-22 22:11:43','2011-09-22 22:11:43',78,4,5,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (81,11,'\n<p><span>На Уфимку даже транец некуда клеить! У неё же кормы нет. Два носа.</span></p>','talk',NULL,NULL,NULL,1,NULL,108,108,'2011-10-18 01:29:38','2011-10-18 01:29:38',11,4,5,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (82,11,'\n<p><span>Я миникоту пользую. Электрическую. Для рыбалки как раз. Аккумулятор на часа 4 хватает, потом подзарядка. Главное шума нет, слышишь как вода плещет. И в водорослях - камышах можно. Да и бюджетно</span></p>','talk',NULL,NULL,NULL,1,NULL,228,228,'2011-10-14 07:52:39','2011-10-14 07:52:39',11,6,7,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (83,11,'\n<p><span>А можно ли под электромотор использовать автомобильный акамулятор где то на 85а/ч? На сколько времени его будет хватать?</span></p>','talk',NULL,NULL,NULL,1,NULL,209,209,'2011-10-07 21:20:19','2011-10-07 21:20:19',11,8,15,1);
