insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (86,83,'Не знаю, внешене они не отличаются. Только на автомобилях стоят стартовые ак-ры, они ИМХО долго не выдержат. Тут нужен тяговый, который долго разряжается. У меня ак-тр 75 ампер/час, вот его при полном ходе хватает часа на четыре. При среднем и малом на дооооолго. И дорожить (троллинг) на электромоторе супер, на низких оборотах не греется.','talk',NULL,NULL,NULL,1,NULL,228,228,'2011-10-13 02:39:52','2011-10-13 02:39:52',11,13,14,2);
