insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (92,91,'\n<p>Я читаю отзывы и заказываю через интернет, потому что у нас в городе выбора нет вообще и цены намного дороже...</p>','talk',NULL,NULL,NULL,2,NULL,35,35,'2011-10-04 13:25:46','2011-10-04 13:25:46',91,2,3,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (93,91,'\n<p><span>В интернете можно почертнуть общие технические характеристики ,</span></p>\n<p>которые отнюдь не означают что что спининг подойдёт под условия ловли ,</p>\n<p>под применяемые приманки, да и вообще ляжет в руку,</p>\n<p>я виртуально покупал всего один спининг ( точнее бланк)&nbsp;но зато по отзывам человека , мнению которого я доверяю как своему ,&nbsp;тут не ошибся на 100%&nbsp;В магазине на потрях в настоящее время я не ошибусь с выбором на 95%&nbsp;просто потому что я буду трясти америкацев,&nbsp;а их типология и предначначение хорошо читаются не только по надписям,&nbsp;но и на ощупь</p>','talk',NULL,NULL,NULL,2,NULL,199,199,'2011-08-05 13:03:45','2011-08-05 13:03:45',91,4,5,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (94,91,'\n<p><span>Дело каждого,-например я на потряс как правило не ошибаюсь,процентов на 90 успех,по отзывах из нета,-нет,нет,и нет...Допустим мне не легли в руку хвалёные Эвиды и Банаксы -определённые модели конечно,по крайней мере те которые попали мну в руки а это Крои и Меги,-строй не понравился.Беркли Черивудики купил в трёх размерах чисто исходя из средне-быстрого строя,цены и цвета ,если хотите.&nbsp;</span><span>Недавно взял спин,(на название принципияльно не смотрел) чисто понравилась на ощупь,оказался отличный джиговый вариант от Каиды. Вчера протестил,всё ок.&nbsp;</span>Руобе Якдаун покупал чисто из-за надписи джапан и Руобе,на потряс скажем мягкий,гибкий чисто японский характер,строй не мой,но палку палюбил ващще за интилект.Никому не продам,такая умняха нужна самому.Короче моё МСМ (моё скромное мнение)нужно всё лапать ручищами и по больше проводить время на рыбалке,там всё покажет.</p>','talk',NULL,NULL,NULL,2,NULL,146,146,'2011-07-25 08:40:36','2011-07-25 08:40:36',91,6,9,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (95,94,'\n<p></p>\n<p><span>+1</span></p>\n<p>Тоже был опыт покупки спиннинга по интернету, не держав его в руках-спин был продан(((.Теперь поступаю по другому.</p>\n<p>1. Вычитываю отзывы в нете.</p>\n<p>2. Нахожу в магазинах(возможно у кого то из рыбаков) даную модель и тестирую на потрях.</p>\n<p>3. Перерываю интернет в поисках оптимальной цены и делаю заказ.</p>\n<p>Если же нет возможности в магазинах потрусить, томожно найти пользователей в нете и в личке задать интересующие вопросы.</p>','talk',NULL,NULL,NULL,2,NULL,210,210,'2011-09-07 14:38:44','2011-09-07 14:38:44',91,7,8,2);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (96,NULL,'root','talk',NULL,NULL,NULL,3,NULL,247,247,'2011-10-17 09:17:48','2011-10-17 09:17:48',96,1,14,0);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (97,96,'\n<p><span>Последние пару лет нравится ловить красноперку на спин. Приманки у меня в основном Мепсы 00-0, твистеры до дюйма максимум по типу \"каролины\" отдельно от груза, воблеры Dorado Magic, Salmo Tiny. Практики маловато, расчитываю в будущем сезоне это дело не забросить. Интересная статейка по этому поводу есть. Почитайте, может что нового узнаете.</span></p>','talk',NULL,NULL,NULL,3,NULL,124,124,'2011-10-20 13:09:42','2011-10-20 13:09:42',96,2,3,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (98,96,'\n<p>Тоже заметил что пескарь часто провожает на мелких перекатах воблер когда тот чиркает по песчаному или каменистому дну, бодает и пощипывает его, иногда засекаясь. При желании действительно можно наловить на сковородочку. И почему то агрессией отличается только весной - может кладку икры охраняет, а может от самочек отганяет или территорию охраняет - но в то что атакует чтобы съесть не верится тем более что воблеры чуть меньше его самого и просто в рот не влезут. А к вертушкам относится поспокойней.</p>','talk',NULL,NULL,NULL,3,NULL,157,157,'2011-10-19 18:25:59','2011-10-19 18:25:59',96,4,9,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (99,98,'\n<p>Ты прав на все сто! На мелководье воблер чиркал песчаное дно, и именно тут брал пескарь. При проводке блесны абсолютно не реагировал. Наверное действительно отгонял от кладки \"гостей\". Но при этом все-таки пытался \"гостя\"  укусить.</p>','talk',NULL,NULL,NULL,3,NULL,34,34,'2011-10-21 11:03:07','2011-10-21 11:03:07',96,5,6,2);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (100,98,'\n<p>В этом году именно пескарь неоднократно садился на микроджиг,особенно когда проводил медленно приманку практически по дну,брал жадно в заглот,поначалу было интересно,но после поимки очередного 20-30,стало нудно и пришлось отложить микроджиг в сторону.Было замечено его выход и за воблерами(миноу)</p>','talk',NULL,NULL,NULL,3,NULL,98,98,'2011-10-20 20:55:42','2011-10-20 20:55:42',96,7,8,2);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (101,96,'\n<p>Карась тоже хищник. Ловил и краснопера на воблеры и вертушки, и бычка на всё что закидываешь,  и синца на кастмастер и на кембрик, и верховодку на вертушки....</p>','talk',NULL,NULL,NULL,3,NULL,127,127,'2011-10-18 04:26:20','2011-10-18 04:26:20',96,10,11,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (102,96,'\n<p><span class=\"Apple-style-span\" style=\"line-height: normal; background-color: rgb(248, 248, 248); \">Как-то на одной рыбалке, коллега споймал в течении пяти минут двух килограмовых карасей. Ловил на МДЖ. Тогда я первый раз задумался о том что тоже надо ультралайтом попробывать. Еще один коллега но уже с соседней лодки все на той же рыбалке вытащил карася на 0,5 кг на вертушку Блю Фокс номер 2.</span></p>Все рыбы были пойманы в рот, как положено.','talk',NULL,NULL,NULL,3,NULL,248,248,'2011-10-21 05:06:09','2011-10-21 05:06:09',96,12,13,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (103,NULL,'root','talk',NULL,NULL,NULL,4,NULL,26,26,'2011-08-24 01:35:40','2011-08-24 01:35:40',103,1,16,0);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (104,103,'\n<p>Палка Konger Mikros 215, каст.0.2-5гр.(вес 110 гр.)Катушка Mitchell Avocet 2,G 200F,вес за 210 гр переваливает,другую катушку нехочу ,т.к.доволен полностью этой.(нелья не отметить что цена такого комлекта в пределах 500-600 грн)Тебе же для прута,весом 75 гр,нужна легкая(до 200 гр.)катушка.А хорошая легкая катушка стоит впоряде денег.</p>','talk',NULL,NULL,NULL,4,NULL,98,98,'2011-10-02 09:17:03','2011-10-02 09:17:03',103,2,3,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (105,103,'\n<p><span>на размер катушки еще очень сильно влияет длина спина, ИМХО. Поскольку в более длином спине растояние между катушко держателем и передним кольцом больше - катушку ставить можно больше да и баланс у длинных спинов ( больше 2,1м ) лучше с катушками крупнее. А вообще для спинов длиной до 2-х м и тестом до 7гр. лучше шимановской 1000 не придумаешь, тем более бюджетной. Посколька УЛ дайва начинается с 2000 КІХ сов или SOL  а лучше с Лувиас.&nbsp;</span></p>У самого Евід AVS60ULF2 длина 1,82м тест 0,9-5,5, вес-65гр.\n<br>катушка shimano Saros F 1000 - вес 200гр.\n<br>на рыбалке были всего раз - нравятся, к катушке на твиче вопросов нет\n<br>\n<br>Посмотри среди бюджетных Shimano-Nexave1000FA -215гр., Nasci 1000S, Daiwa CAPRICORN XTC 1500 , Катушка Магнезия от Корморан','talk',NULL,NULL,NULL,4,NULL,157,157,'2011-10-13 20:56:18','2011-10-13 20:56:18',103,4,15,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (106,105,'\n<p>Да,и соглашусь,что баланс катушка+спининг,зависит так же и от длины прута.</p>','talk',NULL,NULL,NULL,4,NULL,98,98,'2011-10-21 19:37:26','2011-10-21 19:37:26',103,5,6,2);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (107,105,'\n<p><span>Длинна спина - 1.80м. тест 3-15г. А есть смысл ставить не 1000 а 2000, потому как если брать Райобі Екусиму, то вес 1000 і 2000 одинаковы...а дальность заброса будет больше&nbsp;</span></p>\n<p> ИМХО</p>','talk',NULL,NULL,NULL,4,NULL,116,116,'2011-10-19 01:50:02','2011-10-19 01:50:02',103,7,12,2);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (108,107,'\n<p>Какой же 2000 кикс у Дайвы ультралайт, это больше лайт.</p>','talk',NULL,NULL,NULL,4,NULL,253,253,'2011-10-21 10:38:18','2011-10-21 10:38:18',103,8,11,3);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (109,108,'\n<p>Это лайт.Ультралайты в основном в промежутке от 0.2 до 7гр</p>','talk',NULL,NULL,NULL,4,NULL,196,196,'2011-10-21 16:27:03','2011-10-21 16:27:03',103,9,10,4);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (110,105,'\n<p><span>ТОЛЬКО НЕ Магнезию и Mini GT 500 от Корморан. Две рыбалки и в мусорник. В Mini GT 500 смазки нет&nbsp;</span><span>Наверное конструкцией не предусмотренно</span></p>','talk',NULL,NULL,NULL,4,NULL,127,127,'2011-10-18 14:42:16','2011-10-18 14:42:16',103,13,14,2);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (111,NULL,'root','talk',NULL,NULL,NULL,5,NULL,210,210,'2011-10-15 12:44:53','2011-10-15 12:44:53',111,1,12,0);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (112,111,'\n<p>делаешь обычную петлю, одеваешь на шпулю и в противоход ей ( петле) начинаешь наматывать шнур, петля сама себя затянет</p>','talk',NULL,NULL,NULL,5,NULL,231,231,'2011-10-16 02:15:04','2011-10-16 02:15:04',111,2,3,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (113,111,'\n<p>Сразу плетенку к шпуле не привязывай,будет проворачиваться при нагрузке.Подмотай сначала немного лески,а потом привязывай плетенку.Другой вариант-сразу на шпулю наклей кусочек скотча или изоленты,а потом мотай плетенку.Можешь сразу завязать плетню самозатягивающимся узлом но на него всеравно наклеить скотч,а потом уже мотать.</p>','talk',NULL,NULL,NULL,5,NULL,116,116,'2011-10-19 21:06:05','2011-10-19 21:06:05',111,4,5,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (114,111,'\n<p></p>\n<br>1. Такой вариант приемлем, 100 м достаточная длина при таком забросе. У твоего хорошего знакомого палка Ламик или Гарик Лумис или скорее Крой с кастом эдак 14 - 32, и кидал грамм 30 наверное, могу и ошибится, но очень похоже. Америкосы всегда занижают вес на 15-20 грамм. Под такой серьезный заброс и размотку шнура покупают сообветствующую, да и катуху желательно со шпулей лонг каст.\n<br>2. Такой шнур проверяю как старый шулер, часть огрубевшей кожи на большом и указательном пальце стираю нулевкой до состояния попы младенца, не бойся через 2-3 дня снова огрубеет. При перемотке пропускаешь между пальцами и все негаразды моментально чувствуются.\n<br>3. Ты живешь не на необитаемом острове, поговори с сомятниками-карпятниками, у них всегда найдется кусок шнура 0,2-0,25 30-40 метров совершенно невостребованный, или старый или не влезший на шпулю после намотки. Леска не годится, хотя бы потому, что ее со временем при высыхании крепко коробит и она портится.\n<br>4. Безузловку ты поставишь на шнур 0,1 но забросить легкую приманку дальше 70 метров не получится в большинстве случаев, на большее расстояние и вес приманки будет поболее и шнурочек помощней. А там безузловку я тебе не советую, с узлом будет поспокойней и в плане обрывов и в плане захлестов, целей будет и спиннинг.','talk',NULL,NULL,NULL,5,NULL,301,301,'2011-10-20 03:43:04','2011-10-20 03:43:04',111,6,11,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (115,114,'\n<p>Нет у меня знакомых карпятников-сомятников, к сожалению. Пока буду леску использовать, а когда придёт время обновить шнуры, то старые на подмотку пущу.</p>','talk',NULL,NULL,NULL,5,NULL,263,263,'2011-10-20 11:26:06','2011-10-20 11:26:06',111,7,10,2);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (116,115,'\n<p><span>Тогда леску возьми повыносливей и когда ее будешь мотать постарайся намотать ее максимально плотно, под нагрузкой, тогда она не будет продавливаться шнуром, хотя после нескольких рыбалок она все одно растянется, это ж леска.</span>А вообще, что б не ждать отработанных шнуров, покупай размотку 250-270 метров и пуляй хоть на все 150 метров, хотя как по мне такой заброс не везде приемлем, допустим ты зацепил кусок травы или хуже того, опавший лист или ничтатую водоросль, и будешь выматывать эту гадость 100 метров? А вот при троллинге, особенно в глубоких местах, где для суперзаглубления буратины отпуск шнура очень большой лишние 50 метров шнура на шпуле не помешают.</p>','talk',NULL,NULL,NULL,5,NULL,301,301,'2011-10-21 08:58:25','2011-10-21 08:58:25',111,8,9,3);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (117,NULL,'root','talk',NULL,NULL,NULL,6,NULL,197,197,'2011-07-22 18:05:16','2011-07-22 18:05:16',117,1,10,0);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (118,117,'\n<p>Можно попробовать при толщине свыше 0.5 мм, но тогда теряется смысл применения флюрокарбона. Возможно это имеет смысл при троллинге. При ловле на обычные приманки лично я даже пробовать не буду. Все вышесказанное ИМХО.</p>','talk',NULL,NULL,NULL,6,NULL,275,275,'2011-10-05 12:42:46','2011-10-05 12:42:46',117,2,7,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (119,118,'\n<p>реч идет о толщине 0,5 флюрокарбона?</p>','talk',NULL,NULL,NULL,6,NULL,207,207,'2011-10-06 08:37:05','2011-10-06 08:37:05',117,3,6,2);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (120,119,'\n<p>Именно! Есть еще такая штука \"Hard mono\". По заявке производителя щука его не берет, хотя мало верится.</p>','talk',NULL,NULL,NULL,6,NULL,275,275,'2011-10-20 06:23:27','2011-10-20 06:23:27',117,4,5,3);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (121,117,'\n<p>Флуорокарбон не ест щука-это миф. Кусает и перекусывает! Альтернативы металлу пока не видел.</p>','talk',NULL,NULL,NULL,6,NULL,236,236,'2011-07-25 12:00:15','2011-07-25 12:00:15',117,8,9,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (122,NULL,'root','talk',NULL,NULL,NULL,7,NULL,124,124,'2011-08-09 20:01:43','2011-08-09 20:01:43',122,1,10,0);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (123,122,'\n<p><span class=\"Apple-style-span\" style=\"line-height: normal; background-color: rgb(248, 248, 248); \">хапанул много лет назад Рапаловских воблеров.Из всего оставил себе</span></p>Скиттер Поп 5см и все. Из того что на фото разловлен Хаски Джерк, верхний справа (на него кстати\n<br>и словил свою первую щуку то ли твичингом то ли джергингом), ну а потом сразу же \n<br>перешел на япошек.\n<br>На всех страрых воблерах действительно стоит на лопасти клеймо Ireland, а на \n<br>Magnum выбито Finland. Так что там качество еще на нормальном уловистом уровне.','talk',NULL,NULL,NULL,7,NULL,199,199,'2011-08-23 15:14:02','2011-08-23 15:14:02',122,2,3,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (124,122,'\n<p>А я не считаю Рапала лидерами в производстве воблеров мне более импонирует Юзури,Дайва,Пантон,Зип бэйтси др.Рапала-воблера не долговечные и быстро убиваются,так как основа их материала бальза,а взять например Их модель Гласс Шад Рап сделаную из пластика,которой я половил один месяц и выкинул после прокуса щуки на 2 кг.Плюсами считаю широту выбора и заложеную игру,так как практически все воблера Рапала не дают сбоев при проводке.Раньше я был помешан на Рапале и брал вобы только этого производителя,но после некоторого времени мой товарищ убедил меня в качестве Юзури и на данный момент вобы Юзури являются для меня номер один</p>','talk',NULL,NULL,NULL,7,NULL,98,98,'2011-09-21 12:59:51','2011-09-21 12:59:51',122,4,9,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (125,124,'\n<p>Я ни в коем разе не стремлюсь возвысить фирму Рапала. Лидерами я их назвал лишь из-за того, что они вроде первыми начали воблеры выпускать. К остальным вышеперечисленным фирмам отношусь с уважением. Просто для себя хочу определиться что такое Рапала - просто раскрученный бренд или реально уловистые модели воблеров. Недавно скачал Рапаловский фильм о рыбалке, после его просмотра и решил запостить эту тему... уж больно красиво у них там всё получается</p>','talk',NULL,NULL,NULL,7,NULL,302,302,'2011-10-09 14:47:16','2011-10-09 14:47:16',122,5,8,2);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (126,125,'\n<p>И то и другое,они реально уловистые и не менее раскрученые,только не долговечные ну и конечно иногда не качественно сделаные</p>','talk',NULL,NULL,NULL,7,NULL,98,98,'2011-10-14 05:50:55','2011-10-14 05:50:55',122,6,7,3);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (127,NULL,'root','talk',NULL,NULL,NULL,8,NULL,170,170,'2011-10-15 10:48:46','2011-10-15 10:48:46',127,1,10,0);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (128,127,'\n<p><span>Я имею четыре штуки и в дальнейшем думаю пополнять коллекцию именно этим брендом.</span></p>\n<p>Слыхал мнения, где не ловит ничего- Бейтсы все-таки способны спровоцировать рыбу.\n<br>Игра воблеров на высоте. Держат струю великолепно, никаких намеков на штопоры.\n<br>Качество исполнения- любой другой бренд может только позавидовать.</p>\n<p>Вот мой скудный арсенал, который необходимо пополнить</p>\n<p>Rigge 35F\n<br>Rigge Deep 90F\n<br>Rigge MD86ss\n<br>Craze Rattler (Crank)</p>\n<p>35-й Рыжик- это понятно. Лайт, практически вся рыба.\n<br>Остальные Риджи хочу попробовать по ночному судаку. По щуке- даже писать не стоит. Эта зараза хавает все.\n<br>Кренк- по окуню. Может будет работать по голавлику. \n<br>Покупал нулевку для проводки в проблемных местах над травой.</p>','talk',NULL,NULL,NULL,8,NULL,217,217,'2011-10-17 14:54:31','2011-10-17 14:54:31',127,2,3,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (129,127,'\n<p><span>У меня в наличии только два Риджа, оба 35F. Упирался рыбалок пять, не мог разловить, а потом пошло поехало. По щуке и окуню у меня работал 851окрас, по язю, голавлю, жереху, судачку 811. Проводка лёгенький твич</span></p>\n<p> Крючки стояли уже нормальные. Магнитная система как залипла, так больше и не работала, хотя летит вполне прилично.</p>','talk',NULL,NULL,NULL,8,NULL,127,127,'2011-10-18 16:49:12','2011-10-18 16:49:12',127,4,9,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (130,129,'\n<p><span>Это только внешне кажется, что залипла&nbsp;</span><span>Работает, она там, работает&nbsp;</span><span>Сам тоже на это попадался</span></p>','talk',NULL,NULL,NULL,8,NULL,61,61,'2011-10-19 21:15:56','2011-10-19 21:15:56',127,5,8,2);
