insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (142,141,'\n<p><span>Я на фидер первий раз ловил на пошлых выходных.До этого ловил на поплавок с 6-ти лет.&nbsp;</span><span>Не хотел ловить на фидер из-за любви к поплавку, но на выходных понял - они не конкуренты!Эти две снасти отлично друг друга дополняют.</span></p>\n<p> Сегодня смотрел Щербаковых про фидер.Очень большое желание осваивать этот способ ловли.Очень уж он мне нравиться!</p>','talk',NULL,NULL,NULL,11,NULL,302,302,'2011-10-14 10:28:45','2011-10-14 10:28:45',141,2,3,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (143,141,'\n<p><span class=\"Apple-style-span\" style=\"line-height: normal; background-color: rgb(248, 248, 248); \">Здравствуйте!</span></p>Вот решил немного отдалиться от колхозного фидера и всеж разузнать у знающих людей об фидере!\n<br>Прошу обсудить следующие очень интересующие меня вопросы!\n<br>\n<br><b>Удилище:</b>\n<br>Какое лучше, Тест, Строй, Длина... для каких условий и т.д.\n<br>\n<br><b>Катушка:</b>\n<br>Какого типа и размера катушку лучше всего использовать.\n<br>\n<br><b>Леска/Шнур:</b>\n<br>Плюсы и минусы одного и второго! Диаметр...\n<br>\n<br><b>Монтаж/Оснастка:</b>\n<br>Оснастки применяемые в фидерной ловле!\n<br>\n<br><b>Прикомрка/Приманка:</b>\n<br>Какого типа приманки и прикормки лучше всего использовать!\n<br>\n<br><b>\n<br>Подставки/Сигнализаторы поклевки/Доп. Аксесуары:</b>\n<br>???\n<br>\n<br>Если есть что еще добавить, милости просим','talk',NULL,NULL,NULL,11,NULL,304,304,'2011-10-16 19:39:50','2011-10-16 19:39:50',141,4,5,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (144,141,'\n<p><span>\"Палки\"</span></p>\n<p> Совсем недавно мне довелось услышать от приятеля-рыболова вопрос - какое приобрести удилище? Вопрос далеко не праздный, особенно для человека, впервые знакомящегося с новой для себя и технически сложной снастью. Тот же вопрос задают и новички, впервые знакомящиеся с нахлыстом - палок-то вон сколько, аж двенадцать классов, да если еще учесть и разный строй, то глаза просто разбегаются и в мыслях полный хаос. С фидером, правда, дело обстоит проще - наличные в продаже удилища можно условно разделить на три типа (или четыре, если карповую снасть выделить в особый раздел, или пять, если еще приплести сюда тяжелые сюрфкастовые удилища для донной ловли с морского берега): легкий, средний и тяжелый. Легкие удилища предполагают использование оснасток либо без кормушки, либо с легчайшими пластиковыми кормушками и рассчитаны на ловлю средней рыбы на короткой дистанции. Средними удилищами можно отправлять в воду груз весом до 80 г, ну а тяжелые рассчитаны на большие кормушки, сильное течение и крупную рыбу.\n<br> Мне кажется, что для начинающих поклонников английской донки оптимальной будет \"золотая середина\" - удилище среднего класса длиной 3,5 - 4,0 м. Оно достаточно универсально и позволит вам с равным успехом ловить и полукилограммового карася в тихом пруду, и мерную плотву в небольшой реке, и трехкилограммовых лещей на днепровских просторах. В дальнейшем вы сами поймете, какая ловля вам больше по душе и, может быть, переключитесь на легкую снасть - с тем, чтобы вываживание стограммовой плотвы среди прибрежных водорослей превратилось в волнующее приключение. Или наоборот, выберете для себя тяжелую карповую снасть.\n<br> Обычно фидерные удилища – составные, с несколькими (чаще – тремя) сменными кончиками разной чувствительности. Но встречаются и телескопические, что естественно делает их более дешевыми. Но с абсолютной уверенностью, основываясь на собственном опыте, могу предложить на первых порах обойтись обычным спиннинговым удилищем. Но в этом случае очень важно не злоупотреблять весом груза: при явном переборе он (удилище) очень быстро придет в негодность. Так же необходимо помнить и еще об одной непререкаемой истине: универсальных снастей не бывает! И если Вы нацелены на освоение данного вида ловли ( и очень не исключено, что он вам понравится), будте готовы к приобретению специализированных снастей.</p>','talk',NULL,NULL,NULL,11,NULL,289,289,'2011-09-12 17:22:35','2011-09-12 17:22:35',141,6,7,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (145,NULL,'root','talk',NULL,NULL,NULL,12,NULL,222,222,'2011-09-21 14:05:34','2011-09-21 14:05:34',145,1,14,0);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (146,145,'\n<p><span class=\"Apple-style-span\" style=\"line-height: normal; background-color: rgb(248, 248, 248); \">много слышал хорошено от фанатов федера о Овнер 50922, 50282, 50344 (эт 12-18 номер)</span></p>когда собирал себе снастюхи на фидер,то, прикупил именно эти гаки, но на фидер в эт году еще не ловил. (ловил, но фидерными палками на карпа со снастюхами \"метод\")','talk',NULL,NULL,NULL,12,NULL,81,81,'2011-09-21 17:01:15','2011-09-21 17:01:15',145,2,3,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (147,145,'\n<p>Я использую OWNER с коротким цевьем и лопаткой.</p>','talk',NULL,NULL,NULL,12,NULL,304,304,'2011-09-22 20:36:58','2011-09-22 20:36:58',145,4,11,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (148,147,'\n<p>такими же пользовался,(Owner 50434,№ 8,сечение 0.39 рассчитаны под белую)до прошлой недели ,так подвел зараза разогнулся,в самый ответственный момент,покаместь вычеркнул из списка претендентов,очень нравятся запорожские кованые, а на карася гамакатсу 6.а вот не давно прикупил на сдачу кобру 6 на червя оч неплохие вроде,хотя и китайские.А еще взял магму № 2, ни кто не слышал?</p>','talk',NULL,NULL,NULL,12,NULL,221,221,'2011-09-27 04:56:39','2011-09-27 04:56:39',145,5,10,2);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (149,148,'\n<p><span class=\"Apple-style-span\" style=\"line-height: normal; background-color: rgb(248, 248, 248); \">а какие же у Вас поводки если эти крочки разгибают?</span></p>Во всяком случае у моих диаметр 0.51, да и размер поменьше.\n<br> Потому уверен не разогнуться. Если не пытаться форсировать события с соперником более 5 кил.','talk',NULL,NULL,NULL,12,NULL,304,304,'2011-10-06 13:19:56','2011-10-06 13:19:56',145,6,9,3);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (150,149,'\n<p>поводки у меня 0.18.</p>','talk',NULL,NULL,NULL,12,NULL,221,221,'2011-10-18 11:21:21','2011-10-18 11:21:21',145,7,8,4);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (151,145,'\n<p><span>Ну опять же коль вопросы по крючкам</span></p>\n<p> Крючок берем под насадку(типа так надо) или же под предполагаемую рыбу?\n<br> что касается меня то я всегда ориентировался на рыбу. Логика простая * большому куску рот радауется* да и мелочь меньше доставать будет.на 80% этот подход себя оправдывает.\n<br> Хотя бывают приятные исключения.</p>','talk',NULL,NULL,NULL,12,NULL,301,301,'2011-10-01 14:32:20','2011-10-01 14:32:20',145,12,13,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (152,NULL,'root','talk',NULL,NULL,NULL,13,NULL,37,37,'2011-09-01 03:50:52','2011-09-01 03:50:52',152,1,12,0);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (153,152,'\n<p>Прошлым летом, находясь на отдыхе без снастей, купил сдуру катушку Winner 500 с байтраннером, впечатления самые негативные. Уже пару раз приходилось подтягивать резьбовые соединения, песка боится очень, ролик лескоукладывателя никудышний, посадочные места под подшипники провалены, категорически НЕ РЕКОМЕНДУЮ покупать данную катушку.</p>','talk',NULL,NULL,NULL,13,NULL,162,162,'2011-10-03 09:42:58','2011-10-03 09:42:58',152,2,3,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (154,152,'\n<p>Год назат купил фидерное удилище black panter 3.6m. по качеству неплохое правда тест завысили немного. Давольно неплохие палочки.</p>','talk',NULL,NULL,NULL,13,NULL,115,115,'2011-10-14 09:10:52','2011-10-14 09:10:52',152,4,5,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (155,152,'\n<p>Пользуюсь КОБРА с 5-ю подшипниками.После покупки перебрал - все подшипники посадил в корпус на супер клей. За три года эксплуатации сломалась один раз пружина скобы - теперь скобу закрываю руками (стараюсь).По моему вполне бюджетный вариант.</p>','talk',NULL,NULL,NULL,13,NULL,256,256,'2011-09-02 09:03:41','2011-09-02 09:03:41',152,6,7,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (156,152,'\n<p>Купил 6 штук спиннингов Крокодил тест 100-250, цвет черный, длина 2,4. Брака не замечал. Еще не мочил, но в домашних условиях себя хорошо показали. Правда взял один спиннинг поставил дешевую китайскую катушку и просто кидал грузило весом в 100 грамм. В применении удобен, та и по цене понравился.</p>','talk',NULL,NULL,NULL,13,NULL,202,202,'2011-09-26 22:22:02','2011-09-26 22:22:02',152,8,9,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (157,152,'\n<p>Фидер Salmo Taifun Special Feeder 90 3.00m, довольно чувствительная палка ловлю 2 сезона, нареканий никаких. Рекомендую</p>','talk',NULL,NULL,NULL,13,NULL,210,210,'2011-10-12 11:05:16','2011-10-12 11:05:16',152,10,11,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (158,NULL,'root','talk',NULL,NULL,NULL,14,NULL,301,301,'2011-08-11 09:30:23','2011-08-11 09:30:23',158,1,10,0);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (159,158,'\n<p><span class=\"Apple-style-span\" style=\"line-height: normal; background-color: rgb(248, 248, 248); \">На неизбалованных сельских карпах хорошо работают 2 прикормки:</span></p>1.кукурузная каша быстрого приготовления и пшено 1:1 варить до тех пор, пока в самой каше не начнут появляться большие пузырьки. Варить на слабом огне, а то пригорит! Лучше всего на водяной бане. В качестве ароматизатора грамм 100 молотых семок подсолнуха(молоть семки можно в мясорубке).\n<br>2.то же самое, только горох и манка. Точный рецепт не помню, найду - напишу.','talk',NULL,NULL,NULL,14,NULL,218,218,'2011-10-01 12:37:53','2011-10-01 12:37:53',158,2,7,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (160,159,'\n<p>Да от именно оно, карп не любит фирменых прикормок, ему что-то домашнее подовай.</p>','talk',NULL,NULL,NULL,14,NULL,35,35,'2011-10-05 06:30:06','2011-10-05 06:30:06',158,3,6,2);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (161,160,'\n<p>У меня дома лежит склад этих прикормок(Фишка) и теперь не знаю куда их девать. Хотя есть одна идея по ловле хищника, прочитал в теме \"Активатор клева\"</p>','talk',NULL,NULL,NULL,14,NULL,218,218,'2011-10-14 08:17:42','2011-10-14 08:17:42',158,4,5,3);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (162,158,'\n<p><span>Сначала варю пшеную (или кукурузную крупу,горох) кашу: 1 кг крупы высыпаю в 3 л воды, довожу до кипения,&nbsp;</span></p>\n<p> добаляю 0,5 чайной ложки соли и 5 столовых ложек сахара. \n<br> Еще вам понадобятся панировочные сухари, конопля, рапс, семя льна и подсолнечника, гречиха,\n<br> геркулес — эти ингредиенты надо подсушить на горячей сковороде и перемолоть \"в пыль\" в кофемолке).</p>\n<p> Рецепт прикормки следующий: на 300 г пшена приходится 500 г сухарей, 2 стакана конопли, \n<br> по 1 стакану рапса, льна, гречихи, подсолнечника, геркулеса, \n<br> а также кориандр и корица на кончике чайной ложки. \n<br> Все это тщательно перемешать, чтобы не было комков,\n<br> добавляя понемногу воды ( из водоема).\n<br> Консистенция вашей смеси должна быть такова,\n<br> чтобы слепленные из нее шары размером с апельсин при забросе в место\n<br> ловли не разбивались о воду, а достигали дна, и уже там распадались</p>','talk',NULL,NULL,NULL,14,NULL,169,169,'2011-09-28 23:26:24','2011-09-28 23:26:24',158,8,9,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (163,NULL,'root','talk',NULL,NULL,NULL,15,NULL,180,180,'2011-10-18 21:12:27','2011-10-18 21:12:27',163,1,4,0);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (164,163,'\n<p><span class=\"Apple-style-span\" style=\"line-height: normal; background-color: rgb(248, 248, 248); \">вот рецепт который я вычетал</span></p>Приготовление бойлов\n<br>\n<br>Смесь №1 - манная крупа - 400 г.\n<br>- мука сои - 200 г.\n<br>- порошковое молоко - 200 г.\n<br>- кукурузная мука - 200 г.\n<br>- сахарная пудра - 50 г. \n<br>\n<br>Всё это дело хорошенько перемешать. На 1кг смеси берётся 10-12 яиц, 10-12 мл ароматизатора (на вкус), 1 чайная ложка красителя, 3 ст. ложки подсолнечного масла. Всё это перемешать и в процессе постепенно добавлять в смесь, чтобы получилась однородная масса. \n<br>\n<br>Из полученного смешать шарики, 1-2 см. в диаметре. Варить от одной минуты до трёх. После варки высушить.','talk',NULL,NULL,NULL,15,NULL,98,98,'2011-10-21 08:55:45','2011-10-21 08:55:45',163,2,3,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (165,NULL,'root','talk',NULL,NULL,NULL,16,NULL,180,180,'2011-08-21 06:29:18','2011-08-21 06:29:18',165,1,12,0);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (166,165,'\n<p><span>На дне должен лежать нижний грузик, тогда при поклёвке рыба практически не будет ощущать сопротивления,&nbsp;</span></p>\n<p> а поплавок покажет поклевку.</p>','talk',NULL,NULL,NULL,16,NULL,253,253,'2011-08-26 22:18:33','2011-08-26 22:18:33',165,2,3,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (167,165,'\n<p><span class=\"Apple-style-span\" style=\"line-height: normal; background-color: rgb(248, 248, 248); \">ставь плавающий поплавок на карабинчик, + в такой оснастке что можно в камыш закинуть в окно. разлета нет грузика и поплавка и леска не парусит. но есть и минус - в том что огрузка поплавка дольше. Это порой мешает когда верхний шар воды забит уклейкой и краснапером испивают склёвывать быстрее чем при глухом креплении поплавка.</span></p>\n<br>\n<p><span class=\"Apple-style-span\" style=\"line-height: normal; background-color: rgb(248, 248, 248); \">Грузик от крючка для плотвы и мелочи 15см для крупной рыбы от 20-25см.</span></p>','talk',NULL,NULL,NULL,16,NULL,207,207,'2011-10-06 05:56:18','2011-10-06 05:56:18',165,4,5,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (168,165,'\n<p><span class=\"Apple-style-span\" style=\"line-height: normal; background-color: rgb(248, 248, 248); \">Если дно из мягкого ила, то я крючок держу над самым дном, но всегда надо быть на чеку, так как рыба быстро почувствует грузик, поэтому подсечка на первых поклёвках.</span></p>\n<br>\n<p><span class=\"Apple-style-span\" style=\"line-height: normal; background-color: rgb(248, 248, 248); \">Так-же не ложу груз на дно если оно в водорослях или хороший жор.</span></p>','talk',NULL,NULL,NULL,16,NULL,208,208,'2011-09-01 07:24:28','2011-09-01 07:24:28',165,6,7,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (169,165,'\n<p>Все зависит от конкретных условий ловли. Какую рыбу ловить собрались? Поводок ставлю лесой тоньше, чем основная на 0,05 - 0,1мм и длинной от 15 до 20см.</p>','talk',NULL,NULL,NULL,16,NULL,158,158,'2011-08-24 00:59:05','2011-08-24 00:59:05',165,8,9,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (170,165,'\n<p><span class=\"Apple-style-span\" style=\"line-height: normal; background-color: rgb(248, 248, 248); \">Считаю важным при ловле в камышах . Здесь нет места для маневра - хоп и в очерети .</span></p>Водоросли на дне , илистое дно . С грузиком и расстояние до крючка 10-15 см много свободного хода ....\n<br>Рыбачу на мормышку размером чуть больше спич . головки . Крючок по рыбе - больше , меньше .\n<br>Стоит коснуться рыбе насадки- поплавок всплыл - подсечка -садок .\n<br>При ловле в ряске мормышка больше , чтобы пробивала . Тоже есть преимущество : здесь насадка вместе с мормышкой сразу пробивает ряску , а не грузик пробил , а насадка зависла на слое ряски .\n<br>Такой мой способ .','talk',NULL,NULL,NULL,16,NULL,283,283,'2011-09-10 07:57:54','2011-09-10 07:57:54',165,10,11,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (171,NULL,'root','talk',NULL,NULL,NULL,17,NULL,160,160,'2011-10-08 10:31:06','2011-10-08 10:31:06',171,1,4,0);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (172,171,'\n<p></p>\n<br>А если серьезно, то сам люблю его ловить...причем не на открытом, а в камышах, кувшинках. Залажу с лодкой в самые заросли, но так чтоб передомной было несколько окон не большого размера, иногда достаточно сантиметров 20 на 20. В отвес опускаю поочереди аккуратно в них насадку, стараясь не шуметь. Снасть как можно легче, так как ловля в отвес, то и поплавок не тяжелее грамма.(так как на тонкой леске приходится поднимать вертикально, зевать нельзя....поклевка и зацеп за камыши...)\n<br>\n<br>Заранее нахожу пару мест и прикормив их плаваю поочереди облавливая. Насадку использую в основном червь.\n<br>\n<br>Видел как ловили, таким же образом, так с вечера специально вырезали окна в камыше, насадка хлеб с картошкой. \n<br> Бывает часто что карп рвет....','talk',NULL,NULL,NULL,17,NULL,123,123,'2011-10-14 14:48:39','2011-10-14 14:48:39',171,2,3,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (173,NULL,'root','talk',NULL,NULL,NULL,18,NULL,213,213,'2011-09-30 07:28:17','2011-09-30 07:28:17',173,1,14,0);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (174,173,'\n<p>Что значит не крупная,она легко дотягивается до 1,5 кг!Сам лично ловил на блесну 800-900гр! А на поплавчанку на кузнечика!</p>','talk',NULL,NULL,NULL,18,NULL,130,130,'2011-10-06 14:59:45','2011-10-06 14:59:45',173,2,3,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (175,173,'\n<p>у нас краснопера нормально поймать можно только весной хочу этой весной попробывать на блесенку единичка мэпс а на что ты ловиш</p>','talk',NULL,NULL,NULL,18,NULL,129,129,'2011-10-22 19:11:40','2011-10-22 19:11:40',173,4,5,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (176,173,'\n<p>Я восновном на бутерброды (мотыль+опарыш), или на тесто и \"балтушку\" с добавлением черьвя. Хочу до 1 апреля успеть половить, у нас тоже весна- лучший клев красОпера. Хотелось бы больше узнать о насадках и прикормках на неё. НЕLP!!!</p>','talk',NULL,NULL,NULL,18,NULL,243,243,'2011-10-03 09:57:52','2011-10-03 09:57:52',173,6,7,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (177,173,'\n<p>у нас красноперка в основном идет на ручейника! Я еще не пробовал, но знакомые ребята уже были на рыбалке (у нас есть в лесу дикое озеро) и говорят,  что она не плохо идет на ручейника!</p>','talk',NULL,NULL,NULL,18,NULL,247,247,'2011-10-16 11:05:42','2011-10-16 11:05:42',173,8,9,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (178,173,'\n<p><span class=\"Apple-style-span\" style=\"line-height: normal; background-color: rgb(248, 248, 248); \">красноперку лучше всего ловить на тесто. причем не стоит все время сидеть на одном месте если не клюет, это вам не карп, нужно искать.</span></p>в среднем за 1,5 часа можно поимать пару десятков.','talk',NULL,NULL,NULL,18,NULL,180,180,'2011-10-13 15:52:59','2011-10-13 15:52:59',173,10,11,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (179,173,'\n<p><span class=\"Apple-style-span\" style=\"line-height: normal; background-color: rgb(248, 248, 248); \">Лично я,краснапёрку ловил на красного червя(лиственик)</span></p>Попадался и на кукурузу(консервировани)\n<br>Надо чтобы крючок ноходился примерно 10см.от дна.\n<br>Но мне,её ловля не так захвативает.\n<br>Ловля Карася куда интересней!','talk',NULL,NULL,NULL,18,NULL,41,41,'2011-10-20 20:51:35','2011-10-20 20:51:35',173,12,13,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (180,NULL,'root','talk',NULL,NULL,NULL,19,NULL,105,105,'2011-10-05 12:16:38','2011-10-05 12:16:38',180,1,4,0);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (181,180,'\n<p>Хочу обратить Ваше внимание на Banax Pro Mega, есть 6 и 7 метров, лёгкое,отлично сбалансированное, оптимальное сочетание цена-качество, считаю в его ценовой категории конкурентов нет. Имею шестёрку, можно спокойно ловить, держа одной кистью. А торг.маркам Голден Кетч и Флагман у меня недоверчивое отношение. Уж лучше выбрать что-то из Микадо, там модельный ряд большой.</p>','talk',NULL,NULL,NULL,19,NULL,49,49,'2011-10-16 22:04:48','2011-10-16 22:04:48',180,2,3,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (182,NULL,'root','talk',NULL,NULL,NULL,20,NULL,126,126,'2011-10-03 10:33:13','2011-10-03 10:33:13',182,1,8,0);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (183,182,'\n<p>У меня кстати тоже вопросик . Эхолота никогда не было . , денег особо много тратить не хочу ( да и не могу пожалуй ) Скажите пожалуйста : возможно ли на вторичном рынке купить что нибудь стоящее Тысяч за 5ооо рб ? Если да , то на что стоит прежде всего обратить внимание при покупке ( и как вариант где хоть примерно можно помотреть ). А может быть за эти дунюжки возможно купить что то новое , но при этом не сильно навороченное ? Информации у меня никакой , опыта пользования девайсом нет . поэтому Рад буду любому вобщем совету . Заранее премного Благодарен .</p>','talk',NULL,NULL,NULL,20,NULL,49,49,'2011-10-16 17:38:04','2011-10-16 17:38:04',182,2,5,1);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (184,183,'\n<p><span>Я себе приобрел \"Эхолот Egle FishEasy 245 DS , Eagle (15004)\"</span></p>\n<p> Плюсом к нему аккум и зарядку. получилось 7 тыщ с копейками. Опробовал на Мологе.\n<br> Для меня, рыболова со стажем, но начинающего пользователя лодки с мотором и эхолота, достойная модель. Дно рисует хорошо, минимум настроек и приблуд. Раньше я там плавал на весельной Уфимке и ямки с бровками знал + - 5 метров. С эхом все точнее, + еще много нового увидел.</p>','talk',NULL,NULL,NULL,20,NULL,203,203,'2011-10-22 15:47:14','2011-10-22 15:47:14',182,3,4,2);
insert  into `comment`(`id`,`parent`,`message`,`toward`,`location_id`,`profit_id`,`inbox_id`,`talk_id`,`fish_event_id`,`created_by`,`updated_by`,`created_at`,`updated_at`,`root_id`,`lft`,`rgt`,`level`) values (185,182,'\n<p>Самого простого, однолучегого достаточно знать что под лодкой.</p>','talk',NULL,NULL,NULL,20,NULL,207,207,'2011-10-09 16:37:01','2011-10-09 16:37:01',182,6,7,1);
