 на базе в период проведения Фестиваля)</span></span><br /> <span style=\"color: black;\"><span style=\"font-family: Verdana;\">-</span><span style=\"font-family: Verdana;\"><span style=\"color: red;\">500 рублей</span></span><span style=\"font-family: Verdana;\"> Регистрационный взнос Фестиваля с участника </span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"color: black;\">(Участие в мероприятии организованным клубом. Праздничный фуршет посвящённый закрытию Фестиваля!)</span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"color: red;\">От регистрационных взносов(500 руб) освобождаются:</span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"color: black;\">- Дети до 16 лет.</span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"color: black;\">- Ветераны ВОВ.</span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"color: black;\">-Дети до 12 лет Скидка 80% (проезд в автобусе на основном месте, проживание на базе на дополнительном месте)</span></span></p>','<p><span style=\"font-size: 13.5pt;\"><span style=\"font-size: 14pt;\"><span style=\"font-size: x-small;\"><span style=\"font-size: medium;\">Денисов Андрей Александрович (МАРЛИН) <span style=\"color: #00cc66;\">8.903-142-30*42<br /></span>Микожанс Эрикс Владимирович (ZHANS) <span style=\"color: #00cc66;\">8.905-598-34*63</span></span></span></span></span></p>','','',682,5,'2011-09-01 01:32:41','2011-09-21 01:32:41',37,37);
