insert  into `fish_event`(`id`,`date`,`name`,`description`,`schedule`,`price`,`contact`,`rules`,`users`,`location_id`,`fish_event_type_id`,`created_at`,`updated_at`,`created_by`,`updated_by`) values (4,'2011-07-30','РАСКАТЫ 2011','<div align=\"center\"><span style=\"font-size: medium;\"><span style=\"color: red;\">Уважаемые Друзья!</span></span><img class=\"inlineimg\" title=\"Друзья\" src=\"http://www.rusfishing.ru/forum/images/smilies/friends.gif\" alt=\"\" border=\"0\" /><br /> <span style=\"color: blue;\">Главной целью Фестиваля является дружеское общение </span><span style=\"color: blue;\">и обмен опытом рыболовов из разных городов и регионов России, </span><span style=\"color: blue;\">а также популяризация любительского </span><span style=\"color: blue;\">рыболовства и пропаганда ответственного отношения к водоемам и их обитателям.</span></div>','<p><span style=\"text-decoration: underline;\">1-й день</span> (30.07.) Заезд на базу.........</p>\r\n<div align=\"left\">С 14.00 часов (<span style=\"color: red;\">личный транспорт</span>), размещение, отдых.<br /> В 21.00 Общий сбор участников в центральной беседке базы!</div>\r\n<p><br /> <span style=\"text-decoration: underline;\">2-й день</span> (31.07.) &ndash; с 6.00 &ndash; Получение лодок, инструктаж по технике безопасности, знакомство с акваторией.<br /> <span style=\"color: red;\">15:00 &ndash;Торжественное Открытие Фестиваля! Старт Фестиваля!</span><br /> <br /> <span style=\"text-decoration: underline;\">3-й день</span> (01.08.) &ndash; Фестивалим!!!<img class=\"inlineimg\" title=\"Тащу\" src=\"http://www.rusfishing.ru/forum/images/smilies/5.gif\" alt=\"\" border=\"0\" /> <img class=\"inlineimg\" title=\"Друзья\" src=\"http://www.rusfishing.ru/forum/images/smilies/friends.gif\" alt=\"\" border=\"0\" /><img class=\"inlineimg\" title=\"Клево\" src=\"http://www.rusfishing.ru/forum/images/smilies/victory.gif\" alt=\"\" border=\"0\" /><br /> (рыбалка, отдых, общение единомышленников)<br /> <br /> <span style=\"text-decoration: underline;\">4-й день</span> (02.08.) &ndash; продолжаем Фестивалить<img class=\"inlineimg\" title=\"Друзья\" src=\"http://www.rusfishing.ru/forum/images/smilies/friends.gif\" alt=\"\" border=\"0\" /><img class=\"inlineimg\" title=\"Клево\" src=\"http://www.rusfishing.ru/forum/images/smilies/victory.gif\" alt=\"\" border=\"0\" /><img class=\"inlineimg\" title=\"Тащу\" src=\"http://www.rusfishing.ru/forum/images/smilies/5.gif\" alt=\"\" border=\"0\" /> <img class=\"inlineimg\" title=\"Улыбка\" src=\"http://www.rusfishing.ru/forum/images/smilies/smil.gif\" alt=\"\" border=\"0\" />!<br /> <br /> <span style=\"text-decoration: underline;\">5-й день</span> (03.08.) &ndash; продолжение Рыболовного Праздника<img class=\"inlineimg\" title=\"Тащу\" src=\"http://www.rusfishing.ru/forum/images/smilies/5.gif\" alt=\"\" border=\"0\" /><img class=\"inlineimg\" title=\"Друзья\" src=\"http://www.rusfishing.ru/forum/images/smilies/friends.gif\" alt=\"\" border=\"0\" />!<br /> <br /> <span style=\"text-decoration: underline;\">6-й день</span> (04.08.) &ndash; продолжение Рыболовного Праздника<img class=\"inlineimg\" title=\"Тащу\" src=\"http://www.rusfishing.ru/forum/images/smilies/5.gif\" alt=\"\" border=\"0\" /><img class=\"inlineimg\" title=\"Друзья\" src=\"http://www.rusfishing.ru/forum/images/smilies/friends.gif\" alt=\"\" border=\"0\" />!<br /> <br /> <span style=\"text-decoration: underline;\">7-й день</span> (05.08.) - последний день рыболовного турнира до 20.00 час.<br /> <span style=\"color: #ff0000;\">21.00 &ndash; подведение итогов Закрытие Фестиваля! </span><br /> <span style=\"color: #ff0000;\">Торжественое </span><span style=\"color: #ff0000;\">награждение победителей!!! </span><br /> <span style=\"color: #ff0000;\">22.00 Фуршет, посвящённый закрытию Фестиваля! Баран-пати на вертеле<img class=\"inlineimg\" title=\"Хорошо\" src=\"http://www.rusfishing.ru/forum/images/smilies/thumbup1.gif\" alt=\"\" border=\"0\" /></span><br /> <br /> <span style=\"text-decoration: underline;\">8-й день</span> (06.08.) - свободный режим, отдых, рыбалка. <span style=\"color: red;\">В 12.00 выезд с базы.</span><br /> <br /> Информационная поддержка: <br /> <br /> -Центральный Форум Рыбаков. МОО Центральный рыболовный клуб <span style=\"color: blue;\"><span style=\"text-decoration: underline;\">\"RUSFISHING\"</span></span><br /> <br /> Форма проведения соревнований: <br /> -Соревнования проводятся в <span style=\"color: red;\"><span style=\"color: blue;\"><strong>командном зачёте</strong></span>(<strong>экипаж-2 участника</strong><img class=\"inlineimg\" title=\"Друзья\" src=\"http://www.rusfishing.ru/forum/images/smilies/friends.gif\" alt=\"\" border=\"0\" />)</span>.</p>','<div align=\"center\"><span style=\"color: red;\">Вариант №1 </span><br /> (проживание в домике <span style=\"font-family: \'Times New Roman\';\"><span style=\"color: blue;\"><a href=\"http://www.protoka.ru/foto/econom/\" target=\"_blank\"><strong>Эконом</strong></a></span></span>) <span style=\"color: red;\">4850 рублей</span><br /> Составляющие части.....<br /> 3850 рублей(проживание на базе на время проведения Фестиваля) 1000 рублей(регистрационный взнос на проведение мероприятия и коллективный фуршет <span style=\"color: #8b0000;\">\"баран-пати\"</span> на зыкрытии Фестиваля)</div>\r\n<p>&nbsp;</p>\r\n<div align=\"center\"><span style=\"color: red;\">Вариант №2 </span><br /> (проживание в домике <span style=\"font-family: \'Times New Roman\';\"><span style=\"color: blue;\"><a href=\"http://www.protoka.ru/foto/comfort/\" target=\"_blank\"><strong>Комфорт</strong></a></span></span>) <span style=\"color: red;\">9400 </span><span style=\"color: red;\">рублей</span><br /> Составляющие части.....</div>\r\n<p>&nbsp;</p>\r\n<div align=\"center\">8400 рублей(проживание на базе на время проведения Фестиваля) 1000 рублей(регистрационный взнос на проведение мероприятия и коллективный фуршет <span style=\"color: #8b0000;\">\"баран-пати\"</span> на зыкрытии Фестиваля)</div>\r\n<p><br /> </p>\r\n<div align=\"center\"><span style=\"color: red;\">Вариант №3</span><br /> (проживание в домике <span style=\"font-family: \'Times New Roman\';\"><span style=\"color: blue;\"><a href=\"http://www.protoka.ru/foto/comfort/\" target=\"_blank\"><strong>Комфорт - Плюс</strong></a></span></span>) <span style=\"color: red;\">10100 </span><span style=\"color: red;\">рублей</span><br /> Составляющие части.....</div>\r\n<p>&nbsp;</p>\r\n<div align=\"center\">9100 рублей(проживание на базе на время проведения Фестиваля) 1000 рублей(регистрационный взнос на проведение мероприятия и коллективный фуршет <span style=\"color: #8b0000;\">\"баран-пати\"</span> на зыкрытии Фестиваля)</div>\r\n<p><br /> </p>\r\n<div align=\"center\"><span style=\"color: red;\">Вариант №4</span><br /> (проживание <strong><span style=\"font-family: \'Times New Roman\';\"><span style=\"color: blue;\">Коттедж с кухней</span></span></strong>) <span style=\"color: red;\">86</span><span style=\"color: red;\">00 </span><span style=\"color: red;\">рублей</span><br /> Составляющие части.....</div>\r\n<p>&nbsp;</p>\r\n<div align=\"center\">7600 рублей(проживание на базе на время проведения Фестиваля) 1000 рублей(регистрационный взнос на проведение мероприятия и коллективный фуршет <span style=\"color: #8b0000;\">\"баран-пати\"</span> на зыкрытии Фестиваля)</div>\r\n<p><br /> </p>\r\n<div align=\"center\"><span style=\"font-family: Verdana;\"><span style=\"color: red;\">От регистрационного взноса освобождаются дети до 14 лет:</span></span><br /> Дети до 7 лет <br /> проживание на базе на дополнительном месте <span style=\"color: #ff0000;\">бесплатно</span><br /> <span style=\"color: #ff0000;\"><span style=\"color: black;\">Дети от 7 до 12 лет</span> </span><br /> <span style=\"color: #000000;\">проживание на базе на дополнительном месте <span style=\"color: red;\">50 % от стоимости</span></span></div>','<div align=\"center\"><span style=\"color: #8b0000;\"><span style=\"font-family: Verdana;\">Денисов Андрей Александрович </span><span style=\"font-family: Verdana;\">(МАРЛИН)</span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"color: #006400;\">8.903-142-30*42</span></span><br /> <span style=\"color: #8b0000;\"><span style=\"font-family: Verdana;\">Микожанс Эрикс Владимирович </span><span style=\"font-family: Verdana;\">(ZHANS) </span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"color: #006400;\">8.905-598-34*63</span></span></div>','<p>1. Турнир проводится по следующим номинациям (<strong><span style=\"color: red;\">ЛУЧШИЙ ЭКИПАЖ</span></strong><img class=\"inlineimg\" title=\"Друзья\" src=\"http://www.rusfishing.ru/forum/images/smilies/friends.gif\" alt=\"\" border=\"0\" />); <span style=\"color: red;\">Каждому участнику экипажа Победителя вручается кубок Фестиваля + Приз от спонсоров!</span><br /> <br /> <strong><span style=\"color: blue;\">&middot;</span></strong> <img class=\"inlineimg\" title=\"Кубок\" src=\"http://www.rusfishing.ru/forum/images/smilies/4.gif\" alt=\"\" border=\"0\" /> <span style=\"font-size: small;\"><span style=\"color: #006400;\"><strong>&laquo;Краснопёрка&raquo;</strong> <span style=\"color: blue;\">Чемпион-</span><span style=\"color: red;\">1 место</span></span></span><br /> <span style=\"font-size: small;\"><span style=\"color: #006400;\"><strong>&middot; <img class=\"inlineimg\" title=\"Кубок\" src=\"http://www.rusfishing.ru/forum/images/smilies/4.gif\" alt=\"\" border=\"0\" /> &laquo;Окунь&raquo;</strong> <span style=\"color: #0000ff;\">Чемпион-</span><span style=\"color: red;\">1 место</span></span></span><br /> <span style=\"font-size: small;\"><span style=\"color: red;\"><span style=\"color: #0000ff;\"><strong>&middot; <img class=\"inlineimg\" title=\"Кубок\" src=\"http://www.rusfishing.ru/forum/images/smilies/4.gif\" alt=\"\" border=\"0\" /> </strong></span><span style=\"font-size: small;\"><span style=\"color: #006400;\"><strong>&laquo;Жерех&raquo;</strong> <span style=\"color: #0000ff;\">Чемпион-</span><span style=\"color: red;\">1 место</span></span></span></span></span><br /> <span style=\"font-size: small;\"><span style=\"color: #006400;\"><strong>&middot; <img class=\"inlineimg\" title=\"Кубок\" src=\"http://www.rusfishing.ru/forum/images/smilies/4.gif\" alt=\"\" border=\"0\" /> &laquo;Щука&raquo;</strong> <span style=\"color: #0000ff;\">Чемпион-</span><span style=\"color: red;\">1 место</span></span></span><br /> <span style=\"font-size: small;\"><span style=\"color: #ff0000;\"><span style=\"font-size: small;\"><span style=\"color: #006400;\"><strong>&middot; <img class=\"inlineimg\" title=\"Кубок\" src=\"http://www.rusfishing.ru/forum/images/smilies/4.gif\" alt=\"\" border=\"0\" /></strong> <strong>&laquo;Сом&raquo;</strong> <span style=\"color: #0000ff;\">Чемпион-</span><span style=\"color: red;\">1 место</span></span></span><br /> <span style=\"font-size: small;\"><span style=\"color: #006400;\"><strong>&middot; <img class=\"inlineimg\" title=\"Кубок\" src=\"http://www.rusfishing.ru/forum/images/smilies/4.gif\" alt=\"\" border=\"0\" /> &laquo;Карась&raquo;</strong> <span style=\"color: #0000ff;\">Чемпион-</span><span style=\"color: red;\">1 место</span></span></span><br /> </span></span><span style=\"font-size: small;\"><span style=\"color: #006400;\"><strong>&middot;</strong> <img class=\"inlineimg\" title=\"Кубок\" src=\"http://www.rusfishing.ru/forum/images/smilies/4.gif\" alt=\"\" border=\"0\" /> <strong>&laquo;Золотой Сазан&raquo;</strong> <span style=\"color: #0000ff;\">Чемпион-</span><span style=\"color: red;\">1 место</span></span></span><br /> <br /> 2. Один экипаж может принять участие во всех номинациях одновременно!<br /> 3. Победитель выявляется по наибольшему весу (на личное усмотрение экипажа) самой крупной рыбы. В случае если вес одинаковый у нескольких экипажей, победитель определяется по самому большому второму (третьему) экземпляру, предоставленному судейской бригаде (на взвешивание предоставляется до трёх рыб).<br /> 4. Регистрация улова возможна сразу по ходу проведения соревнований- 31, 01, 02<span style=\"color: black;\">, 03,04 и <span style=\"text-decoration: underline;\"><span style=\"color: red;\">05</span></span> в течении всего светового дня в </span>кафе базы.<br /> 5. В зачет принимаются:<br /> -Вся рыба согласно утверждённых номинаций, <span style=\"color: red;\">соответствующая правил установленного Законодательства.</span><br /> <br /> 6. В соревнованиях по &laquo;Стайной рыбе&raquo; можно использовать: поплавочные и донные снасти всех типов, количество прикормки не ограничено.<br /> 7. В соревнованиях по &laquo;Хищнику&raquo; - можно использовать блёсна всех типов, воблеры, снасточки, кружки, лов на дорожку (троллинг) с применением мускульной силы и мотора с использованием не более двух искусственных приманок.<br /> 8. В соревнованиях по &laquo;Сом&raquo;- можно использовать снасти предусмотренные в п.6, п.7., и лов \"на квок\".<br /> 9. Места лова, в зависимости от предпочтения самого участника.<br /> 10. Все спорные вопросы решаются судейской бригадой.<br /> 11. <span style=\"color: red;\">Минимальный размер рыбы принимаемой в зачет (см.)</span><br /> <span style=\"color: green;\">Жерех 32</span><br /> <span style=\"color: green;\">Красноперка 17<br /> </span><span style=\"color: green;\">Щука 32</span><br /> <span style=\"color: green;\">Сазан 40</span><br /> <span style=\"color: green;\">Сом пресноводный 60</span><br /> <span style=\"color: blue;\">Судак 40</span><br /> <span style=\"color: blue;\">Лещ 24</span><br /> <span style=\"color: blue;\">Вобла, плотва 17</span><br /> <span style=\"color: blue;\">Красноперка 17</span><br /> <span style=\"color: blue;\">Чехонь 22</span><br /> <span style=\"color: blue;\">Линь 22</span></p>','',485,5,'2011-07-02 15:20:16','2011-09-22 15:20:16',221,221);
insert  into `fish_event`(`id`,`date`,`name`,`description`,`schedule`,`price`,`contact`,`rules`,`users`,`location_id`,`fish_event_type_id`,`created_at`,`updated_at`,`created_by`,`updated_by`) values (5,'2011-07-30','3 этап турнира РУСФИШИНГА 2011 г.','<p>1. Статус соревнований<br /> <br /> 1.1. Открытые соревнования по спортивной ловле рыбы донной удочкой.<br /> <br /> 2. Цели и задачи<br /> <br /> 2.1. Популяризация рыболовного спорта, повышение мастерства любителей и спортсменов,пропаганда спортивных принципов в ловле на фидер.<br /> 2.2. Выявление сильнейших и удачливых рыбаков среди участников.<br /> <br /> 3. Руководство соревнования<br /> <br /> 3.1. Подготовка соревнований возлагается на Оргкомитет, сформированный \"ФС РФ\".<br /> 3.2. Непосредственное проведение соревнований возлагается на Оргкомитет и Главную судейскую коллегию.</p>','<p>30 июля 2011 г.<br /> 6:00 - 7:00 Регистрация участников соревнования.<br /> 7:00 - 7:30 Жеребьевка<br /> 7:30 - 8:00 Время на доставку снастей, прикормки и насадки в секторы.<br /> 8:00 - Первый сигнал, вход в зону, начало подготовки.<br /> 09:30 - Второй сигнал, старт.<br /> 14:30 - Третий сигнал, финиш<br /> 14:30 - 15:30 Взвешивание.</p>','<p>Расходы спортсменов, связанные с проездом и оплатой вступительного взноса,несут сами участники соревнований.<br />Вступительный взнос на соревнование составляет 500 р.,за тур.</p>','<p><a href=\"mailto:omigo@list.ru\">omigo@list.ru</a></p>','<p>1. Соревнования проводятся в соответствии с Правилами МФРС. <br /> 2. Соревнования проводятся в 1 тур, продолжительностью 5 часов, в соответствии с регламентом (п.9).<br /> 3. При количеств участников более 20 ,будет произведена разбивка на зоны,в зоне не может быть менее 8 спортсменов. Ширина сектора &ndash; 10 метров. <br /> 4. Имеются ограничения по прикормке и насадке. Один спортсмен,в одном туре,имеет право использовать не более 5 кг сухой смеси, включая грунты и балласты, не более 1,1 кг мотыля,включая насадочного, 1 литра опарыша и не более 1 кг прочих живых компонентов, разрешенных Правилами МФРС. Приготовление прикормки разрешается до сигнала &laquo;вход в зону&raquo; в любом месте, кроме секторов, в которых будут располагаться спортсмены, после сигнала &laquo;вход в зону&raquo; - исключительно в своем секторе.По требованию судьи участник соревнований обязан предъявить к осмотру всю находящуюся в секторе прикормку, насадку и снасти. Проверка судейской бригадой прикормки и насадки должна быть завершена в течение первой половины времени, отведенного спортсменам на подготовку.<br /> 5. В процессе ловли запрещается дополнительный замес прикормки,внесение в нее сухих ароматизаторов,увеличивающие ее объем.В процессе ловли запрещено перемешивать прикормку при помощи электрошуруповертов. Доувлажнять прикормку разрешено только при помощи пульверизатора. Использование жидких ароматизаторов разрешено.<br /> 6. Минимальная разрешенная длина садка, сетка которого изготовлена из естественной или искусственной нити &ndash; 2 метра. Применение металлического садка запрещено.<br /> 7. В зачет идет любая рыба, пойманная и извлечённая из воды до сигнала \"Финиш\" кроме рыбы, занесенной в Красную книгу(чехонь) и рыбы пойманной (рыбы всплывшей при вываживании) в чужом секторе.<br /> 8. Пробные рыбалки разрешены в любой день, за исключением дня, предшествующего соревнованиям. За нарушение данного пункта спортсмены не будут допускаться к регистрации. <br /> 9. После сигнала &laquo;Финиш&raquo; спортсмену запрещается покидать свой сектор до сигнала &laquo;взвешивание окончено&raquo;.<br /> <br /> Подведение результатов и награждение<br /> <br /> 1. Участники,занявшие призовые места, награждаются Кубком, медалью, грамотой.<br /> 2. Участник, поймавший самую крупную рыбу, награждается специальным ценным подарком. <br /> 4. Возможно учреждение дополнительных призов от спонсоров.</p>','',690,4,'2011-06-06 09:44:10','2011-09-06 09:44:10',289,289);
insert  into `fish_event`(`id`,`date`,`name`,`description`,`schedule`,`price`,`contact`,`rules`,`users`,`location_id`,`fish_event_type_id`,`created_at`,`updated_at`,`created_by`,`updated_by`) values (6,'2011-08-21','4 этап \"Чемпионата Русфишинга по ловле фидером 2011г.\" Среди любителей. ','<p>&nbsp;Открытые соревнования по спортивной ловле рыбы донной удочкой.&nbsp;Подготовка соревнований возлагается на Оргкомитет, сформированный \"ФС РФ\".&nbsp;Непосредственное проведение соревнований возлагается на Оргкомитет и Главную судейскую коллегию.</p>','<p>20 августа 2011 г.<br /> 05:30 - 06:00 Регистрация участников соревнования.<br /> 06:00 - 06:10 Жеребьевка<br /> 06:10 - 06:30 Время на доставку снастей, прикормки и насадки в секторы.<br /> 06:30 - Первый сигнал, вход в зону, начало подготовки.<br /> 08:00 - Второй сигнал, старт.<br /> 13:00 - Третий сигнал, финиш<br /> 13:00 - 13:30 Взвешивание,подведение итогов.</p>','<p>Расходы спортсменов, связанные с проездом и оплатой вступительного взноса,несут сами участники соревнований.<br />Вступительный взнос на соревнование составляет 1000 р.,за тур.</p>','<p>Предварительная регистрация в обязательном порядке проводится посредством отправки e-mail <a href=\"mailto:omigo@list.ru\">omigo@list.ru</a></p>','<p>Соревнования проводятся в соответствии с Правилами МФРС. <br />Соревнования проводятся в 1 тур, продолжительностью 5 часов, в соответствии с регламентом (п.9).<br />При количеств участников более 20 ,будет произведена разбивка на зоны,в зоне не может быть менее 8 спортсменов. Ширина сектора &ndash; 10 метров. <br />Имеются ограничения по прикормке и насадке. Один спортсмен,в одном туре,имеет право использовать не более 5 кг сухой смеси, включая грунты и балласты, не более 1,1 кг мотыля,включая насадочного, 1 литра опарыша и не более 1 кг прочих живых компонентов, разрешенных Правилами МФРС. Приготовление прикормки разрешается до сигнала &laquo;вход в зону&raquo; в любом месте, кроме секторов, в которых будут располагаться спортсмены, после сигнала &laquo;вход в зону&raquo; - исключительно в своем секторе.По требованию судьи участник соревнований обязан предъявить к осмотру всю находящуюся в секторе прикормку, насадку и снасти. Проверка судейской бригадой прикормки и насадки должна быть завершена в течение первой половины времени, отведенного спортсменам на подготовку.<br />В процессе ловли запрещается дополнительный замес прикормки,внесение в нее сухих ароматизаторов,увеличивающие ее объем.В процессе ловли запрещено перемешивать прикормку при помощи электрошуруповертов. Доувлажнять прикормку разрешено только при помощи пульверизатора. Использование жидких ароматизаторов разрешено.<br />Минимальная разрешенная длина садка, сетка которого изготовлена из естественной или искусственной нити &ndash; 2 метра. Применение металлического садка запрещено.<br />В зачет идет любая рыба, пойманная и извлечённая из воды до сигнала \"Финиш\" кроме рыбы, занесенной в Красную книгу и рыбы пойманной (рыбы всплывшей при вываживании) в чужом секторе.<br />Пробные рыбалки разрешены в любой день, за исключением дня, предшествующего соревнованиям. За нарушение данного пункта спортсмены не будут допускаться к регистрации. <br />После сигнала &laquo;Финиш&raquo; спортсмену запрещается покидать свой сектор до сигнала &laquo;взвешивание окончено&raquo;.<br />По окончании соревнования,вся рыба выпускается обратно.<br /> <br />Подведение результатов и награждение<br /> <br />Участники,занявшие призовые места, награждаются Кубком, медалью, грамотой.<br />Участник, поймавший самую крупную рыбу, награждается специальным ценным подарком. <br />Возможно учреждение дополнительных призов от спонсоров.</p>','',694,4,'2011-07-03 12:08:44','2011-10-03 12:08:44',51,51);
insert  into `fish_event`(`id`,`date`,`name`,`description`,`schedule`,`price`,`contact`,`rules`,`users`,`location_id`,`fish_event_type_id`,`created_at`,`updated_at`,`created_by`,`updated_by`) values (7,'2011-08-27','ЩУЧЬИ ЗАБАВЫ 2011','<p><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"color: black;\"><span style=\"font-family: Verdana;\">К участию допускаются </span></span></span><span style=\"color: blue;\"><span style=\"font-family: Verdana;\">ВСЕ ЖЕЛАЮЩИЕ</span></span><span style=\"color: black;\"><span style=\"font-family: Verdana;\">, достигшие совершеннолетнего возраста с 18 лет!</span></span></span></span><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"color: black;\"><span style=\"font-family: Verdana;\"> Вы так же можете привезти с собой детей, возраст бесплатного лова для которых будет определен правилами КРХ на котором проводятся соревнование.&nbsp;<br /><span style=\"color: #0000ff;\"><strong>Если оценить стоимость снастей и подарков предоставленных спонсорами<br /> общий призовой фонд составляет - </strong><strong><span style=\"font-size: small;\"><span style=\"color: red;\">60.000-65.000 руб.</span></span>!</strong></span>&nbsp;</span></span></span></span></span></p>','<p><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"color: black;\"><span style=\"font-family: Verdana;\">- Регистрация <span style=\"color: red;\">05</span></span></span></span><span style=\"color: red;\"><span style=\"font-family: Verdana;\">:00</span></span> <span style=\"color: black;\"><span style=\"font-family: Verdana;\">&ndash; <span style=\"color: red;\">05</span></span></span><span style=\"color: red;\"><span style=\"font-family: Verdana;\">:45 </span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"color: black;\"><span style=\"font-family: Verdana;\">- Торжественное открытие <span style=\"color: red;\">05</span></span></span></span></span></span><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"color: red;\"><span style=\"font-family: Verdana;\">:45</span></span> <span style=\"color: black;\"><span style=\"font-family: Verdana;\">&ndash; </span></span><span style=\"color: red;\"><span style=\"font-family: Verdana;\">06:00</span></span></span></span><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><br /> <span style=\"font-family: Verdana;\"><span style=\"color: black;\"><span style=\"font-family: Verdana;\">- СТАРТ в <span style=\"color: red;\">06</span></span></span></span><span style=\"color: red;\"><span style=\"font-family: Verdana;\">:00</span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"color: black;\"><span style=\"font-family: Verdana;\">- ФИНИШ в </span></span></span><span style=\"color: red;\"><span style=\"font-family: Verdana;\">11:00</span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"color: black;\"><span style=\"font-family: Verdana;\">- Определение победителей и награждение </span></span></span><span style=\"color: red;\"><span style=\"font-family: Verdana;\">11:00 </span></span><span style=\"color: black;\"><span style=\"font-family: Verdana;\">&ndash; <span style=\"color: red;\">12</span></span></span><span style=\"color: red;\"><span style=\"font-family: Verdana;\">:30</span></span></span></span><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><br /></span></span></p>','<p><span style=\"color: #0000ff;\"><span style=\"color: black;\">Регистрационный взнос составляет <span style=\"color: black;\">2000 руб.</span> с участника.</span><br /> <span style=\"color: black;\">В эту сумму <strong>включено безлимитное количество пойманной щуки</strong>.</span></span></p>','<p><strong><span style=\"color: #ff0000;\"><span style=\"font-size: small;\">8 (495) 589-8979</span></span></strong></p>','<p><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"color: black;\"><span style=\"font-family: Verdana;\">ПО ПРИЕЗДУ на место проведения соревнования, каждому участнику необходимо зарегистрироваться в точке сбора, и получить на руки номер участника. Никаких документов удостоверяющих личность для этого </span></span></span><span style=\"color: black;\"><span style=\"font-family: Verdana;\">НЕ ТРЕБУЕТСЯ</span></span> <span style=\"color: black;\"><span style=\"font-family: Verdana;\">. Для получения номера просто назовите судье свою фамилию и имя. После получения номера участника, необходимо оставаться в точке сбора до процедуры сверки часов и объявления старта. <span style=\"color: red;\">По завершению соревнования и награждения победителей вы при желании сможете продолжить ловлю</span>.</span></span></span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"color: black;\"><span style=\"font-family: Verdana;\"> <br /></span></span></span></span><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"color: blue;\"><span style=\"font-family: Verdana;\">СНАСТИ</span></span> <span style=\"color: black;\"><span style=\"font-family: Verdana;\">для ловли разрешены ЛЮБЫЕ (кроме запрещенных правилами любительского рыболовства). <br /> <br /></span></span></span></span><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"color: blue;\"><span style=\"font-family: Verdana;\">СПОСОБ ЛОВЛИ</span></span> <span style=\"color: black;\"><span style=\"font-family: Verdana;\">любой. Спиннинг, нахлыст, бомбарда, джерки и т.п. Только одна любая снасть закинутая в воду. Количество запасных снастей на берегу не ограничено.<br /> <br /></span></span></span></span><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"color: black;\"><span style=\"font-family: Verdana;\">Расстояние при лове должно быть не менее 5-и метров от другого участника. Если на вас поступят жалобы от других участников, за это нарушение следует предупреждение, в случае повторной жалобы дисквалификация. Но за всю историю проводимых нами соревнований ни одной жалобы зафиксировано не было, так как все мероприятия Русфишинга направлены на сплочение коллектива участников.<br /> <br /></span></span></span></span></span><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"color: black;\"><span style=\"font-family: Verdana;\">Организаторы не несут ответственности за безопасность участников. Будьте пожалуйста внимательны при использовании снастей.<br /> <br /></span></span></span></span><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\">Лицам, прибывшим на соревнование в состоянии сильного алкогольного опьянения, в регистрации будет отказано.<br /> <br /></span></span><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"color: black;\"><span style=\"font-family: Verdana;\">В зачет идет только щука. Призёры будут определяться по весу самой крупной пойманной щуки</span></span></span>.<br /><br /><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"color: black;\"><strong><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"color: red;\"><strong>Награждение будет проходить в двух зачетах!!!:</strong></span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"color: black;\"><strong><span style=\"color: blue;\">Основной зачет:</span><br /> <img class=\"inlineimg\" title=\"Кубок\" src=\"http://www.rusfishing.ru/forum/images/smilies/4.gif\" alt=\"\" border=\"0\" /></strong></span></span></span><span style=\"color: black;\"><span style=\"font-family: Verdana;\"> 1-е место <span style=\"text-decoration: underline;\">по крупной рыбе</span></span> <span style=\"font-family: Verdana;\">- кубок, медаль + призы от спонсоров</span> </span><br /> </span></span></strong></span></span></span></span></span><strong><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"color: black;\"><strong><img class=\"inlineimg\" title=\"Кубок\" src=\"http://www.rusfishing.ru/forum/images/smilies/4.gif\" alt=\"\" border=\"0\" /></strong></span></span></span></span></span><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"color: black;\"><span style=\"font-family: Verdana;\"> 2-е </span></span></span></span><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"color: black;\"><span style=\"font-family: Verdana;\">место <span style=\"text-decoration: underline;\">по крупной рыбе</span></span> <span style=\"font-family: Verdana;\">- </span></span></span></span></strong><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"color: black;\"><strong><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"color: black;\"><span style=\"font-family: Verdana;\">кубок, </span></span></span></span></strong></span></span></span></span></span><span style=\"font-family: Verdana;\"><strong><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"color: black;\"><span style=\"font-family: Verdana;\">медаль + призы от спонсоров</span></span><br /> </span></span><span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"fo