insert  into `fish_event`(`id`,`date`,`name`,`description`,`schedule`,`price`,`contact`,`rules`,`users`,`location_id`,`fish_event_type_id`,`created_at`,`updated_at`,`created_by`,`updated_by`) values (8,'2011-09-03','\"Золотая рыбка-2011\" 4-ой этап (спиннинг,личный зачёт)','<p>Предварительные заявки на участие в соревнованиях подаются в произвольной форме личным сообщением, по телефону или на странице, посвященной 4-ому этапу \"Золотой рыбки\" <a href=\"http://www.rusfishing.ru/forum/showthread.php?t=38637\" target=\"_blank\">http://www.rusfishing.ru/forum/showthread.php?t=38637</a>.<br /> Заявка должна содержать следующую обязательную информацию:<br /> - фамилия, имя и отчество участника;<br /> - год рождения;<br /> - место жительства(наименование населенного пункта);<br /> - способ прибытия на соревнования. Огромная просьба к тем, кто прибывает на личном транспорте, в заявке указывайте возможность взять с собой пассажира (количество)</p>','<p>- 7.00&ndash;8.45 - прибытие, регистрация; <br /> - 8.30- 8.45 &ndash; построение, инструктаж;<br /> - 8.45 -9.00 &ndash; развод участников по зонам акватории соревнований;<br /> - 9.00 - старт 1 тура;<br /> - 11.30 - конец 1-тура; <br /> - 12.10 -12.15- построение, инструктаж;<br /> - 12.15 -12.30 &ndash; смена зон, развод участников по зонам акватории соревнований;<br /> - 12.30 - старт 2 тура;<br /> - 15.00 &ndash;финиш<br /> - 15.00-16.30 подведение итогов, награждение победителей.</p>','<p>Взнос с участника составляет 450 руб. От уплаты взносов освобождаются рыболовы младше 17 (включительно) и старше 60 (включительно) лет, при предоставлении документа, удостоверяющего личность.<br /> Рыболовы до 17 (включительно) лет могут быть допущены к участию только при сопровождении взрослого.</p>','<p>Сыченко Игорь Владимирович (Harris) (926)138-60-0 два<br /> Бурлин Борис Викторович (boxter72) (962)941-41-6 два</p>','<p>Порядок учета пойманной участниками соревнований рыбы.<br /> <br />После поимки рыбы спортсмен должен максимально быстро предоставить для взвешивания пойманную рыбу, подозвав для этого ближайшего судью; <br />При отсутствии в непосредственной близости судьи, до его подхода, спортсмен должен принять все меры для сохранения в живом виде пойманного экземпляра;<br />Вид, вес и время поимки, каждой пойманной участником соревнований зачетной рыбы, фиксируются линейным, либо главным судьей, в личной карточке участника соревнований; <br />Линейный, либо главный судья дублирует все записи, сделанные им в личных карточках участников соревнований, в своем личном судейском протоколе;<br />Любая запись, произведенная судьей, как в личной карточке участника соревнований, так и в личном судейском протоколе, в обязательном порядке, подлежит заверению подписью данного судьи, и подписью участника соревнований, в личную карточку которого, была произведена данная запись.<br />Каждая пойманная участниками соревнований рыба, после замера и взвешивания, подлежит изъятию у участников соревнований и поступает в распоряжение судьи, производившего фиксацию поимки данной рыбы.<br />В свою очередь, судья сразу после фиксации каждой пойманной участниками соревнований рыбы, обязан либо ее отпустить, либо если рыба не подает признаков жизни, положить ее в заранее подготовленную емкость, которую следует передать, после окончания текущего тура, главному судье для последующей утилизации. <br /> <br />Ловля производится спиннинговой снастью любого типа на одну приманку. Разрешается иметь при себе несколько оснащенных удилищ.<br /> <br />Участникам соревнований запрещается:<br /> <br />производить ловлю рыбы до сигнала \"Старт\" и после сигнала \"Финиш\";<br />производить ловлю рыбы, находясь вне акватории соревнований;<br />осуществлять ловлю рыбы в течении первых тридцати минут в иной зоне, нежели была установлена по итогам жеребьёвки;<br />распивать спиртные напитки и находиться в зоне соревнований в нетрезвом виде;<br />ловить на приманки животного происхождения;<br />целенаправленно ловить рыбу в отвес;<br />одновременно использовать две и более приманки, оснащенные крючками;<br />получать помощь от других спортсменов и посторонних лиц, кроме случаев, связанных с оказанием первой помощи, а так же с предотвращением угрозы здоровью и жизни участников соревнований;<br />покидать акваторию во время соревнований без разрешения линейного судьи.<br /> <br />Участник может быть снят с соревнований:<br />за нарушение порядка и правил проведения соревнований, изложенных в данном Положении;<br />за поведение, оскорбляющее нравственное и человеческое достоинство.<br /> <br />Все спорные моменты во время соревнований решаются линейными судьями. В случае несогласия участник вправе обратиться к Главному судье соревнований, чье решение является окончательным.</p>','',635,4,'2011-08-19 18:16:41','2011-08-19 18:16:41',281,281);
insert  into `fish_event`(`id`,`date`,`name`,`description`,`schedule`,`price`,`contact`,`rules`,`users`,`location_id`,`fish_event_type_id`,`created_at`,`updated_at`,`created_by`,`updated_by`) values (9,'2011-09-15','По ЩУЧЬЕМУ велению','<p><span style=\"color: red;\"><strong>ыезд открытый</strong></span><span style=\"color: black;\">.</span><span style=\"color: #8b0000;\"> Принять участие в выезде могут не только члены Клуба, но и Ваши родственники, друзья, знакомые, а также все желающие согласные с Правилами выездов.</span></p>','<p><em><span style=\"color: red;\"><span style=\"color: #0000ff;\">День 1-й </span></span></em></p>\r\n<div align=\"left\"><em><span style=\"color: red;\"><span style=\"text-decoration: underline;\">15 сентября (четверг)</span> </span></em><br /> <em><span style=\"color: black;\">06.00 - Заезд на базу. Размещение.</span></em><br /> <span style=\"color: black;\"><em>06.30 - 07.00 Завтрак. Получение лодок.</em></span><br /> <em>07.30 - 19.00 Рыбалка, отдых!</em><br /> <em>19.00 -Ужин</em><br /> <em><span style=\"color: #0000ff;\">День 2-й</span></em><br /> <em><span style=\"color: red;\"><span style=\"text-decoration: underline;\">16 сентября (пятница)</span></span></em><br /> <em><span style=\"color: black;\">06.30 - 07.00 Завтрак.</span></em><br /> <em><span style=\"color: black;\">13.00- Открытие Фестиваля! </span></em><br /> <em>13.00-19.00 Фестивалим-РЫБАЛКА!</em><br /> <em><span style=\"color: black;\">19.00 - Ужин. </span></em><br /> <em>21.00 <span style=\"color: #006400;\">Взвешивание уловов!</span></em><br /> <em><span style=\"color: #0000ff;\">День 3-й</span></em><br /> <em><span style=\"color: red;\"><span style=\"text-decoration: underline;\">17 сентября (суббота) </span></span></em><br /> <em><span style=\"color: black;\">06.30 - 07.00 Завтрак.</span></em><br /> <em>07.00-19.00 Фестивалим-РЫБАЛКА!</em><br /> <em><span style=\"color: black;\">19.00 - Ужин.</span></em><br /> <em><span style=\"color: black;\">21.00 </span><span style=\"color: #006400;\">Взвешивание уловов!</span></em><br /> <em><span style=\"color: #0000ff;\">День 4-й</span></em><br /> <em><em><span style=\"color: red;\"><span style=\"text-decoration: underline;\">17 сентября (воскресенье)</span> </span></em></em><br /> <em><em><span style=\"color: black;\">06.30 - 07.00 Завтрак.</span></em></em><br /> <em><em>07.00-15.00 Фестивалим-РЫБАЛКА!</em></em><br /> <em><em><span style=\"color: black;\">14.00 - <span style=\"color: #006400;\">Взвешивание уловов!</span></span></em></em><br /> <em><em><span style=\"color: black;\">14.30 -Торжественное закрытие Фестиваля! </span></em></em><br /> <em>15.00 - Обед. Выезд с базы.</em></div>','<div align=\"center\"><span style=\"color: #ff6600;\"><span style=\"color: #006400;\"><strong>Стоимость участия</strong> (личный транспорт)</span> </span><span style=\"color: red;\">6000</span><span style=\"color: red;\">рублей</span></div>\r\n<p>&nbsp;</p>\r\n<div align=\"center\"><span style=\"color: blue;\">В стоимость входит:</span> <br /> <span style=\"color: black;\">-Участие в Фестивале</span><br /> <span style=\"color: black;\">-Проживание на базе в период с 15 по 18 сентября</span><br /> <span style=\"color: black;\">-Питание (4 завтрака, 4 ужина) </span></div>\r\n<p>&nbsp;</p>\r\n<div align=\"center\"><span style=\"color: blue;\">Дополнительно!</span><br /> <span style=\"color: black;\">- А<span style=\"color: #006400;\">ренда лодки с мотором (без егеря)</span>=</span> 1300 рублей световой день <br /> на 2-3 человека. ГСМ оплачивается по факту)<br /> <span style=\"color: black;\">- А<span style=\"color: #006400;\">ренда лодки с мотором (с егерем)</span> =</span> 2300 рублей световой день <br /> на 2-3 человека. ГСМ оплачивается по факту)<br /> <span style=\"color: red;\">Для личных плавсредств, стоянка и охрана бесплатно!</span></div>\r\n<p>&nbsp;</p>\r\n<div align=\"center\"><span style=\"color: blue;\">Дополнительно!</span><br /> <span style=\"color: black;\">- баня</span><br /> <span style=\"color: black;\">-бильярд</span></div>','','<p><span style=\"color: black;\"><span style=\"font-family: Verdana;\">Турнир проводится только по <strong><span style=\"color: red;\">ЩУКЕ!</span></strong></span></span><br /> <strong><span style=\"color: blue;\"><span style=\"font-family: Verdana;\"><img class=\"inlineimg\" title=\"Кубок\" src=\"http://www.rusfishing.ru/forum/images/smilies/4.gif\" alt=\"\" border=\"0\" />1 место</span></span></strong><br /> <strong><span style=\"color: blue;\"><span style=\"font-family: Verdana;\"><img class=\"inlineimg\" title=\"Кубок\" src=\"http://www.rusfishing.ru/forum/images/smilies/4.gif\" alt=\"\" border=\"0\" />2 место</span></span></strong><br /> <strong><span style=\"color: blue;\"><span style=\"font-family: Verdana;\"><img class=\"inlineimg\" title=\"Кубок\" src=\"http://www.rusfishing.ru/forum/images/smilies/4.gif\" alt=\"\" border=\"0\" />3 место</span></span></strong><br /> <br /><span style=\"font-family: Verdana;\"><span style=\"color: black;\">Победитель выявляется по наибольшему весу (на личное усмотрение) самой крупной щуки. В случае если вес одинаковый у нескольких участников, победитель определяется по самому большому второму (третьему) экземпляру, предоставленному судейской бригаде (на взвешивание предоставляется до трёх рыб).</span></span><br /><span style=\"font-family: Verdana;\"><span style=\"color: black;\">Регистрация улова с 21.00 в кафе базы. (17 сентября с 14.00 до 14.30)</span></span><br /><span style=\"font-family: Verdana;\"><span style=\"color: black;\">В зачет принимаются щука от 40 см.</span></span><br /><span style=\"font-family: Verdana;\"><span style=\"color: black;\">В соревнованиях можно использовать блёсна всех типов, воблеры, снасточки, кружки, лов на дорожку (троллинг) с применением мускульной силы и мотора с использованием не более двух искусственных приманок.</span></span><br /><span style=\"font-family: Verdana;\"><span style=\"color: black;\">Места лова, в зависимости от предпочтения самого участника.</span></span><br /><span style=\"font-family: Verdana;\"><span style=\"color: black;\">Все спорные вопросы решаются судейской бригадой.</span></span><br /><span style=\"font-size: small;\"><span style=\"color: red;\"><span style=\"color: blue;\">Оргкомитет вправе учредить <span style=\"text-decoration: underline;\">дополнительные призы</span></span> <img class=\"inlineimg\" title=\"Кубок\" src=\"http://www.rusfishing.ru/forum/images/smilies/4.gif\" alt=\"\" border=\"0\" />за крупную рыбу других видов, в том числе очень распространённого в этих местах <span style=\"color: blue;\">СУДАК</span>а и <span style=\"color: blue;\">БЕРШ</span>а. </span></span><br /> <span style=\"font-size: small;\"><span style=\"color: red;\"><span style=\"color: #006400;\">Приносите на взвешивание</span><img class=\"inlineimg\" title=\"Улыбка\" src=\"http://www.rusfishing.ru/forum/images/smilies/smil.gif\" alt=\"\" border=\"0\" /></span></span></p>','',696,5,'2011-07-12 09:58:00','2011-07-12 09:58:00',36,36);
insert  into `fish_event`(`id`,`date`,`name`,`description`,`schedule`,`price`,`contact`,`rules`,`users`,`location_id`,`fish_event_type_id`,`created_at`,`updated_at`,`created_by`,`updated_by`) values (10,'2011-09-17','7-й тур Чемпионата Русфишинга по ловле Карповых \"ЛКЛ 2011\"','<p>Организация и руководство проведением соревнования возлагается на оргкомитет, сформированный \"Культурным Рыболовным Хозяйством Ба!Рыбина - далее (КРХ Ба!Рыбина)\" и \"Межрегиональной Общественной организацией Центральным Рыболовным Клубом \"Русфишинг\" - далее (МОО ЦРК \"Русфишинг\")\". <br />Заезд участников и судей на место проведения Чемпионата 17 сентября 2011 года, к 05:15.</p>','<ul>\r\n<li>С <span style=\"color: blue;\">05:15 до 05:50</span> - регистрация и жеребьевка</li>\r\n<li>С <span style=\"color: blue;\">05:50 до 06:05</span> - общее построение, <span style=\"text-decoration: underline;\">всем участникам</span> необходимо присутствовать на построении. <span style=\"color: red;\">Всем участникам необходимо присутствовать на построении!</span></li>\r\n<li>С <span style=\"color: blue;\">06:05 до 07:00</span> - размещение участников по пронумерованным секторам согласно результатам жеребьевки, подготовка снастей, прикармливание. Прикармливать можно на протяжении всего тура, включая время размещения участников с <span style=\"color: black;\">06:05 до 07:00</span>. Количество прикормки не ограничено. Разрешено пользоваться как базовыми, так и самодельными прикормками и насадками. Бросать прикормку в чужой сектор категорически запрещается. Так же разрешены замеры глубин, использование маркеров и ракет.</li>\r\n<li>В <span style=\"color: blue;\">07:00</span> - сигнал на старт и начало ловли.</li>\r\n<li>В <span style=\"color: blue;\">12:00</span> - сигнал на финиш (после сигнала &lt;финиш&gt; поклёвки не регистрируются). <span style=\"text-decoration: underline;\">Снасти необходимо вытащить из воды</span>.</li>\r\n<li>С <span style=\"color: blue;\">12:00 до 13:00</span> - сбор снастей, все участники остаются на своих местах и ждут судей для взвешивания улова, после взвешивания перемещаются к точке старта (лагерю организаторов).</li>\r\n<li>С <span style=\"color: blue;\">13:00 до 13:40</span> - награждение и вручение призов. <span style=\"text-decoration: underline;\">Всем участникам</span> необходимо присутствовать на награждении. Если вам необходимо уехать до награждения, необходимо сообщить об этом организаторам. Если Вы уедите до награждения не предупредив об этом организаторов, все баллы вашего рейтинга полученные за данный тур будут обнулены.</li>\r\n</ul>','<p>Регистрационный сбор <span style=\"text-decoration: underline;\">с команды</span> составляет 3000 руб.<br />Расходы по организации и изготовлению наградной атрибутики несут организаторы и спонсоры кубка.&nbsp;</p>','<p>Заявки на участие в Кубке принимаются в личные сообщения Антонову Александру:<br /> <span style=\"color: red;\"><a href=\"http://www.rusfishing.ru/forum/private.php?do=newpm&amp;u=29\" target=\"_blank\"><span style=\"color: blue;\">http://www.rusfishing.ru/forum/private.php?do=newpm&amp;u=29</span></a></span></p>','<p>К зачёту на взвешивание принимается карп, сазан, линь, амур, карась и плотва. <br />В конце соревнований, после взвешивания улова судьёй, 8 кг. на команду, улова можно забрать с собой, остальную рыбу необходимо отпустить. Карася, плотву и окуня можно забирать с собой без ограничения по весу. <span style=\"color: red;\">Металлические садки запрещены!</span><br />Для ловли команда может одновременно использовать две разные или одинаковые снасти на выбор (удочки, штекер, классические донки, фидеры). Максимальное количество крючков - строго не более 2 шт. на каждую снасть, в сумме не более 4 шт. на две снасти. Строго по одной снасти на участника. Количество запасных снастей \"не заброшенных в воду\" размещённых в секторе на берегу неограниченно. <br />В случае уличения команды в использовании более двух снастей или в использовании более четырёх крючков, команда дисквалифицируется, взнос не возвращается. <br />Перемещение участников между секторами без разрешения судей во время соревнований запрещено. Исключение составляет поход в М/Ж.<br />Зрителям запрещается помогать участникам во время ловли, подсачивать рыбу, держать в руках снасти и т.д. Находится рядом с участниками не создавая шума и проблем окружающим можно.<br />Употребление участниками крепких спиртных напитков во время соревнования строго запрещено.<br />Оргкомитет имеет право отказать в регистрации участнику находящемуся в состоянии сильного алкогольного опьянения (определяется организаторами на месте).<br /><span style=\"color: black;\">Запрещено использовать кислую (прокисшую) прикормку. В случае обнаружения судьёй такой прикормки, она будет изъята.</span> Кормить самодельными кашами разрешено.<br /><span style=\"color: black;\">Запрещено входить в сектор другого участника при вываживании. (отход от берега в рамках границ своего сектора не ограничен).</span><br /><span style=\"color: black;\">Запрещено использование снастей именуемых - \"резинка\" и \"соска\". А так же, устанавливать на одну снасть более 2-х крючков.</span><br /><span style=\"color: black;\"><strong>Запрещено использование металлических садков во избежании травмирования рыбы</strong>.</span><br /><span style=\"color: black;\">При вываживании разрешено заходить в воду в рамках своего сектора на глубину не далее чем по колено, не производя при заходе громких всплесков.</span><br />Уход из сектора раньше времени установленного регламентом без оповещения судей будет расцениваться как неучастие,что в итоге повлияет на рейтинг команды.</p>','',695,4,'2011-09-13 20:26:38','2011-09-13 20:26:38',36,36);
insert  into `fish_event`(`id`,`date`,`name`,`description`,`schedule`,`price`,`contact`,`rules`,`users`,`location_id`,`fish_event_type_id`,`created_at`,`updated_at`,`created_by`,`updated_by`) values (11,'2011-10-29','Осенний Кубок Русфишинга 2011','\r\n<p>Открытые городские соревнования в лично-командном зачете по спортивной ловле рыбы донной удочкой методом квивертип.\r\n<br>Соревнования входят в календарь МФРС и являются рейтинговыми.</p>\r\n<p>Общее руководство соревнованиями осуществляет Московская Федерация Рыболовного спорта.\r\n<br>Подготовка соревнования осуществляется Оргкомитетом, сформированным РК «Русфишинг».\r\n<br>Проведение соревнования осуществляется Оргкомитетом и судейской коллегией.</p>\r\n<p><span>Основной объект ловли - плотва, окунь, уклейка, бычок, карась и др.</span></p>\r\n<p> \r\n<br></p>','\r\n<p><b>29 октября 2011 года, суббота. </b>\r\n<br> 1. Сбор участников и регистрация - 6-00 - 7.00\r\n<br> 2. 7.00-7.15 - СОБРАНИЕ КАПИТАНОВ \r\n<br> 3. Жеребьевка - 7.15-7.45\r\n<br> 4. Расход по секторам - 7.45 -8.30 \r\n<br> 5. Первый сигнал \"вход в сектор\" - 8.30\r\n<br> 6. Второй сигнал \"Старт\" - 10.00\r\n<br> 7. Третий сигнал \"Финиш\" - 14.00\r\n<br> 8. Взвешивание, подведение итогов 1 тура - 14.00-15.30 \r\n<br> <b>30 октября 11 года, воскресенье.</b> \r\n<br> 1. Сбор участников и регистрация - до 6.00-7.00\r\n<br> 2. 7.00-7.15 - СОБРАНИЕ КАПИТАНОВ\r\n<br> 3. Жеребьевка - 7.15-7.45\r\n<br> 4. Расход по секторам - 7.45-8.30 \r\n<br> 5. Первый сигнал \"вход в сектор\" - 8.30\r\n<br> 6. Второй сигнал \"Старт\" - 10.00\r\n<br> 7. Третий сигнал \"Финиш\" - 14.00\r\n<br> 8. Взвешивание, подведение итогов - 14.00-15.30\r\n<br> 9. Награждение победителей - 16.00</p>','\r\n<p><span>1. Все расходы спортсменов, связанные с проездом до места проведения соревнований, а также с выступлением на соревнованиях, несут сами спортсмены, либо командировавшие их организации.</span></p>\r\n<p>2. Взнос на право участия в соревновании составляет 1000 рублей с одного участника или 4000 рублей с команды - в сумме за оба дня соревнований (итого за два тура).</p>\r\n<p>3. Несовершеннолетние спорсмены освобождаются от уплаты организационного взноса.</p>\r\n<p>4. Собранные деньги идут на покрытие организационных расходов.</p>','\r\n<p>Ильин Алексей (Lexx225) – тел. <span tabindex=\"-1\" dir=\"ltr\">&nbsp;<span dir=\"ltr\" title=\"Call this phone number in Russia with Skype: +79055092142\"><span title=\"Skype actions\" skypeaction=\"skype_dropdown\"></span><span skypeaction=\"skype_dropdown\" title=\"Skype actions\"><span skypeaction=\"skype_dropdown\"></span></span>8-905-509-2142</span></span><span></span></p>','\r\n<p><span>Соревнование открытое, лично-командное. Состав команды - 4 человека. Допускается участие в соревнованиях в личном зачете. Ведется 2 зачета - командный и личный.&nbsp;</span></p>\r\n<p>К участию допускаются все желающие, согласные с данным Положением. \r\n<br>Участникам соревнований необходимо иметь при себе: документ, удостоверяющий личность и полис ОМС.\r\n<br>Команды, прибывшие в неполном составе, к участию в соревнованиях не допускаются. Спортсмены команд, прибывших в неполном составе, могут принять участие в соревнованиях в личном зачете. Запасные спортсмены участвуют только в командном зачете, в случае замены ими участника основного состава. Участник основного состава, в случае замены его запасным, прекращает дальнейшее участие в соревнованиях. \r\n<br>Участие в соревнованиях несовершеннолетних спортсменом допускается только в сопровождении родителей или ответственных лиц (с нотариально-заверенным разрешением). \r\n<br><b>Правила проведения соревнований.</b>\r\n<br>Соревнование проводится в соответствии с Правилами МФРС 26.10.10.\r\n<br>Соревнование проводится в два тура. Продолжительность ловли каждого тура 4 часа. Все участники каждого тура жеребьевкой распределяются по четырем зонам. Ширина сектора - 10 метров. Участники, выступающие в личном зачете, распределяются в зонах и секторах согласно жеребьевке на общих условиях. Допускается неодинаковое количество спортсменов в зонах с разницей не более чем в одного спортсмена. Распределение неравномерности по зонам определяется жребием после окончания регистрации и до жеребьевки спортсменов по зонам. \r\n<br>Имеются ограничения по прикормке и насадке. Один спортсмен имеет право использовать в одном туре не более 15 литров увлажненной и просеянной прикормки, включая грунты, балласты, разбивки и т.п., не более 1,1 л мотыля (включая насадочный), 0,5 литра опарыша и не более 0,5 кг прочих живых компонентов, разрешенных Правилами МФРС..\r\n<br>По требованию судьи участник соревнований обязан предъявить к осмотру всю находящуюся в секторе прикормку, насадку и снасти. Проверка судейской бригадой прикормки и насадки должна быть завершена в течение первой половины времени, отведенного спортсменам на подготовку.\r\n<br>Минимальная разрешенная длина садка, сетка которого изготовлена из естественной или искусственной нити - 2,5 метра (обусловлено высотой берега). Применение металлического садка запрещено.\r\n<br>В зачет идет любая рыба, пойманная и извлечённая из воды до начала голосового сигнала \"Финиш\", кроме рыбы занесенной в Красную книгу, рыбы пойманной в чужом секторе, либо всплывшей на поверхность при вываживании в чужом секторе.\r\n<br>Пробные рыбалки непосредственно в месте проведения соревнования разрешены в любое время, за исключением дня, предшествующего соревнованиям (28 октября 2011 года).</p>','\r\n',784,4,'2011-07-24 04:49:22','2011-07-24 04:49:22',31,31);
insert  into `fish_event`(`id`,`date`,`name`,`description`,`schedule`,`price`,`contact`,`rules`,`users`,`location_id`,`fish_event_type_id`,`created_at`,`updated_at`,`created_by`,`updated_by`) values (12,'2011-10-27','По ЩУЧЬЕМУ велению-2','\r\n<p><span><b>Выезд открытый</b></span><span>.</span><span> Принять участие в выезде могут не только члены Клуба, но и Ваши родственники, друзья, знакомые, а также все желающие согласные с Правилами выездов.</span></p>\r\n<p><span><i>Наши рыболовные турниры не носят спортивный характер, это всего лишь рыболовный праздник, в котором всегда побеждает дружба и отличное настроение, а самых удачливых всегда ожидают приятные подарки!&nbsp;</i></span><span></span></p>','\r\n<p><i><span>День 1-й&nbsp;</span></i></p>\r\n<p><span> <i><u>27 октября (четверг)</u> </i></span>\r\n<br> <i><span>06.00 - Заезд на базу. Размещение.</span></i>\r\n<br> <span><i>06.30 - 07.00 Завтрак. Получение лодок.</i></span>\r\n<br> <i><span>07.30</span> -Рыбалка, отдых!</i>\r\n<br> <i><span>13.30-14.00.</span> Обед</i>\r\n<br> <span>14.00-19.00.</span> Рыбалка, отдых!\r\n<br> <i><span>19.00</span> -Ужин</i> \r\n<br> <i><span>День 2-й</span></i>\r\n<br> <i><span><u>28 октября (пятница)</u></span></i>\r\n<br> <i><span>06.30 - 07.00 Завтрак.</span></i>\r\n<br> <i><span>07.30</span> -СТАРТ<span> Рыболовного турнира! </span><img src=\"http://www.rusfishing.ru/forum/images/smilies/4.gif\" alt=\"\" title=\"Кубок\" border=\"0\"></i>\r\n<br> <i><span>07.30-</span><span>13.30</span>- Фестивалим-РЫБАЛКА!</i>\r\n<br> <i><span>13.30-14.00- Обед. </span></i>\r\n<br> <i><span>14.30-19.00</span> Фестивалим-РЫБАЛКА!</i>\r\n<br> <i><span>19.00 - Ужин. </span></i>\r\n<br> <i><span>Взвешивание уловов ежедневно в течении дня!</span></i> \r\n<br> <i><span>День 3-й</span></i>\r\n<br> <i><span><u>29 октября (суббота) </u></span></i>\r\n<br> <i><span>06.30 - 07.00 Завтрак.</span></i>\r\n<br> <i>07.00-19.00 Фестивалим-РЫБАЛКА!</i>\r\n<br> <i><span>13.30-14.00.</span> Обед</i>\r\n<br> <i><span>19.00 - Ужин. Закрытие Рыболовного турнира! Награждение Победителей! </span></i>\r\n<br> <i><span>Взвешивание уловов ежедневно в течении дня! </span></i> \r\n<br> <i><span>День 4-й</span></i>\r\n<br> <i><i><span><u>30 октября (воскресенье)</u> </span></i></i>\r\n<br> <i><i><span>06.30 - 07.00 Завтрак.</span></i></i>\r\n<br> <i><i><span>07.00-13.00</span> РЫБАЛКА, одых!</i></i>\r\n<br> <i><span>13.00 -13.30</span> Обед. </i>\r\n<br> <i><span>Выезд с базы в течении дня.</span></i></p>','\r\n<p><span><b>Стоимость участия</b> </span><span>(личный транспорт)</span> </p>\r\n<p> <span>1-й вариант</span> (заезд на базу на 4 дня, четверг-воскресенье)= <span>6000 рублей</span>\r\n<br> <span>2-й вариант</span> (заезд на базу на 3 дня, пятница-воскресенье)= <span>4500 рублей</span>\r\n<br> <span><b><u>Оплата на базе!</u></b></span> \r\n<br> <span>В стоимость входит: </span>\r\n<br> <span>1-й вариант</span>\r\n<br> <span>-Участие в Фестивале</span>\r\n<br> <span>-Проживание на базе в период с 27 по 30 октября</span>\r\n<br> <span>-Питание (4 завтрака+4 обеда+3 ужина) </span> \r\n<br> <span>2-й вариант</span>\r\n<br> <span>-Участие в Фестивале</span>\r\n<br> <span>-Проживание на базе в период с 28 по 30 октября</span>\r\n<br> <span>-Питание (3 завтрака+3 обеда+ 2 ужина) </span> \r\n<br> <span>Дополнительно!</span>\r\n<br> <span>- Аренда лодки с мотором (без егеря)</span>= 1300 рублей световой день \r\n<br> на 2-3 человека. ГСМ оплачивается по факту)\r\n<br> <span>- Аренда лодки с мотором (с егерем)</span> = 2300 рублей световой день \r\n<br> на 2-3 человека. ГСМ оплачивается по факту)\r\n<br> <span>-А</span><span>ренда лодки без мотора (вёсельная)= цена уточняется световой день </span><span>\r\n<br> на 2 человека</span>\r\n<br> <span>Для личных плавсредств, стоянка и охрана лодки 100 руб/сутки!</span> \r\n<br> <span>Дополнительно!</span>\r\n<br> <span>- баня,</span><span>бильярд</span></p>','\r\n<p><a href=\"http://www.rusfishing.ru/forum/showthread.php?t=8194\">http://www.rusfishing.ru/forum/showthread.php?t=8194</a></p>','\r\n<p><span>1. Турнир проводится только по </span><b><span>ЩУКЕ!</span></b></p>\r\n<p><span>2. Победитель выявляется по наибольшему весу (на личное усмотрение) самой крупной щуки. В случае если вес одинаковый у нескольких участников, победитель определяется по самому большому второму (третьему) экземпляру, предоставленному судейской бригаде (на взвешивание предоставляется до трёх рыб).</span>\r\n<br><span>3. Регистрация улова в течении всего дня.</span>\r\n<br><span>4. В зачет принимаются щука от 40 см.</span>\r\n<br><span>5. В соревнованиях можно использовать блёсна всех типов, воблеры, снасточки, кружки, лов на дорожку (троллинг) с применением мускульной силы и мотора с использованием не более двух искусственных приманок.</span>\r\n<br><span>6. Места лова, в зависимости от предпочтения самого участника.</span>\r\n<br><span>7. Все спорные вопросы решаются судейской бригадой.</span>\r\n<br><span>8. Оргкомитет вправе учредить <u>дополнительные призы&nbsp;</u></span>за крупную рыбу других видов, в том числе очень распространённого в этих местах <span>СУДАК</span>а и <span>БЕРШ</span>а. \r\n<br><span>Приносите на взвешивание</span></p>','\r\n',696,5,'2011-07-13 15:23:31','2011-07-13 15:23:31',105,105);
insert  into `fish_event`(`id`,`date`,`name`,`description`,`schedule`,`price`,`contact`,`rules`,`users`,`location_id`,`fish_event_type_id`,`created_at`,`updated_at`,`created_by`,`updated_by`) values (13,'2011-11-04','Золотая рыбка -2011','\r\n<p><span>Соревнования открытые. Приглашаются все желающие!</span></p>\r\n<p>Дружескую атмосферу и солидный призовой фонд - гарантируем!</p>\r\n<p>Данное мероприятие включено в график соревнований Московской федерации рыболовного спорта (МФРС).\r\n<br>Этап рейтинговый, с официальным присвоением спортивных разрядов.</p>\r\n<p>Предварительные заявки на участие в соревнованиях подаются в произвольной форме личным сообщением, по телефону</p>','\r\n<p>- 7.00–8.45 - прибытие, регистрация\r\n<br>- 8.30- 8.45 – построение, инструктаж; \r\n<br> - 8.45 -9.00 – развод участников по зонам акватории соревнований; \r\n<br> - 9.00 - старт 1 тура; \r\n<br> - 11.30 - конец 1-тура; \r\n<br> - 12.10 -12.15- построение, инструктаж; \r\n<br> - 12.15 -12.30 – смена зон, развод участников по зонам акватории соревнований; \r\n<br> - 12.30 - старт 2 тура; \r\n<br> - 15.00 –финиш \r\n<br> - 15.00-16.30 подведение итогов, награждение победителей.</p>','\r\n<p><span>Взнос с участника составляет 450 руб. От уплаты взносов освобождаются рыболовы младше 17 (включительно) и старше 60 (включительно) лет, при предоставлении документа, удостоверяющего личность.</span></p>\r\n<p> Рыболовы до 17 (включительно) лет могут быть допущены к участию только при сопровождении взрослого.</p>','\r\n<p><span>Сыченко Игорь Владимирович (Harris) (926)138-60-0 два</span></p>\r\n<p> Бурлин Борис Викторович (boxter72) (962)941-41-6 два</p>','\r\n<p>Соревнования проводятся в два тура, продолжительностью по два с половиной часа каждый.</p>\r\n<p>Каждому участнику по результатам жеребьёвки присваивается личный номер, под которым он проходит в судейских протоколах.\r\n<br> \r\n<br>Акватория соревнований имеет две зоны ловли: №1 и №2.\r\n<br> \r\n<br>Распределение участников соревнований по зонам акватории осуществляется следующим образом:\r\n<br> \r\n<br>участники, получившие по результатам жеребьёвки нечетные номера, первые 30 минут осуществляют ловлю рыбы в первом туре соревнований в зоне под №1, во втором туре - в зоне под №2.\r\n<br>участники, получившие по результатам жеребьёвки четные номера, первые 30 минут осуществляют ловлю рыбы в первом туре соревнований в зоне под №2, во втором туре - в зоне под №1.\r\n<br>по истечении первых тридцати минут каждого тура участники соревнований могут свободно перемещаться по всем зонам акватории.\r\n<br> \r\n<br>Команды «Старт», «30 минут после старта», «Финиш» в первом и втором турах осуществляются по сигналу Главного судьи и дублируется линейными судьями.\r\n<br> \r\n<br>Ловля рыбы участниками соревнований производится с берега, строго в пределах определённой настоящим Положением акватории.\r\n<br> \r\n<br>Минимальное расстояние между спортсменами – 5 метров.\r\n<br> \r\n<br>К зачету принимается только рыба, пойманная следующим образом:\r\n<br>- крючки находятся во рту рыбы;\r\n<br>- крючки в районе головы или снизу, под головой, в так называемой «галстучной зоне».\r\n<br>Остальная рыба считается забагренной и к зачету не принимается.\r\n<br> \r\n<br>К зачету принимаются только следующие виды рыб:\r\n<br>- окунь (без ограничений по размеру и количеству);\r\n<br>- щука (длина не менее 32 см);\r\n<br>- судак (длина не менее 40 см);\r\n<br>- жерех (длина не менее 40 см);\r\n<br>- язь (длина не менее 25 см);\r\n<br>- голавль (длина не менее 20 см);\r\n<br>- налим (длина не менее 40 см.).\r\n<br>Контрольный замер рыбы производится от кончика рыла до начала центрального луча хвостового плавника. Рыба, не указанная в данном перечне, а также меньшего размера, к зачету не принимается. В случае поимки такая рыба должна быть максимально быстро и аккуратно выпущена обратно.\r\n<br> \r\n<br>Порядок учета пойманной участниками соревнований рыбы.\r\n<br> \r\n<br>\r\n<br></p>\r\n<p>После поимки рыбы спортсмен должен максимально быстро предоставить для взвешивания пойманную рыбу, подозвав для этого ближайшего судью;\r\n<br>\r\n<br></p>\r\n<p>При отсутствии в непосредственной близости судьи, до его подхода, спортсмен должен принять все меры для сохранения в живом виде пойманного экземпляра;\r\n<br>\r\n<br></p>\r\n<p>Вид, вес и время поимки, каждой пойманной участником соревнований зачетной рыбы, фиксируются линейным, либо главным судьей, в личной карточке участника соревнований;\r\n<br>\r\n<br></p>\r\n<p>Линейный, либо главный судья дублирует все записи, сделанные им в личных карточках участников соревнований, в своем личном судейском протоколе;\r\n<br>\r\n<br></p>\r\n<p>Любая запись, произведенная судьей, как в личной карточке участника соревнований, так и в личном судейском протоколе, в обязательном порядке, подлежит заверению подписью данного судьи, и подписью участника соревнований, в личную карточку которого, была произведена данная запись.\r\n<br>\r\n<br></p>\r\n<p>Каждая пойманная участниками соревнований рыба, после замера и взвешивания, подлежит изъятию у участников соревнований и поступает в распоряжение судьи, производившего фиксацию поимки данной рыбы.\r\n<br>\r\n<br></p>\r\n<p>В свою очередь, судья сразу после фиксации каждой пойманной участниками соревнований рыбы, обязан либо ее отпустить, либо если рыба не подает признаков жизни, положить ее в заранее подготовленную емкость, которую следует передать, после окончания текущего тура, главному судье для последующей утилизации.\r\n<br> \r\n<br>Ловля производится спиннинговой снастью любого типа на одну приманку. Разрешается иметь при себе несколько оснащенных удилищ.</p>','\r\n',785,4,'2011-09-16 20:13:20','2011-09-16 20:13:20',294,294);
