insert  into `location`(`id`,`name`,`description`,`depth`,`is_free`,`price`,`location_flow_id`,`location_fundus_id`,`location_relief_id`,`location_type_id`,`location_scope_id`,`address_id`,`created_by`,`updated_by`,`slug`,`created_at`,`updated_at`,`latitude`,`longitude`,`version`) values (373,'Ока (Калиновские выселки)','Коттеджи &quot;Кордон Кузьмича&quot; находятся на Карельском перешейке в 140 км от Санкт-Петербурга и 20 км от Выборга. Уютные деревянные коттеджи на берегу Финского залива в тихом живописном месте. До воды 10 м вокруг сосны острова. Прекрасное место для отдыха с семьей или компанией единомышленников. В коттеджах &quot;Кордон Кузьмича&quot; есть современная кухня гостиная в стиле охотничьего домика с большим камином. Сауна где вы сможете снять стресс и восстановить жизненные силы. На втором этаже расположены спальни и балкон с завораживающим видом на Финский залив. Коттеджи &quot;Кордон Кузьмича&quot; имеют электрическое отопление холодное и горячее водоснабжение все удобства в доме.',NULL,1,'',NULL,NULL,NULL,NULL,5,335,159,159,'54','2011-06-16 14:12:55','2011-06-16 14:12:55',54.875572092799999,37.320449352299988,2);
