insert  into `location`(`id`,`name`,`description`,`depth`,`is_free`,`price`,`location_flow_id`,`location_fundus_id`,`location_relief_id`,`location_type_id`,`location_scope_id`,`address_id`,`created_by`,`updated_by`,`slug`,`created_at`,`updated_at`,`latitude`,`longitude`,`version`) values (400,'Васильсурская слобода','Наша турбаза располагается на берегу острова Высокий в акватории озера Ловозеро на Кольском полуострове. Удаленность от села Ловозеро - 35 км. На базе имеется современный двухэтажный дом со всеми удобствами сауной бильярдным залом. Отдыхающие обеспечены отличным питанием собственным поваром базы. На базе есть современные импортные снегоходы сани два мотосноуборда для активного отдыха на Севере. Есть мощный моторный катер с водомётным двигателем моторная лодканадувные лодки с моторами. Рыбалка охота треккинг сплавы по тундровым рекам снегоходные сафари катание на мотосноубордах этно-туры – это и многое другое мы готовы предложить нашим гостям.',NULL,0,'',NULL,NULL,NULL,NULL,5,362,49,49,'79','2011-01-29 06:27:36','2011-01-29 06:27:36',56.137515741900003,45.930404663099999,2);
