ИТЕЛЬНО, ПО СУЩЕСТВУЮЩИМ РАСЦЕНКАМ НА РЫБУ:\n\nФОРЕЛЬ – 400 р/кг.\n\nЩУКА, СОМ ЕВРОПЕЙСКИЙ, СОМ КАНАЛЬНЫЙ -300 р/кг.\n\nКАРП, САЗАН, БЕЛЫЙ АМУР – 200 р/кг.\n\nОСЁТР – 800 р/кг.\n\nОСОБИ ЛУБОГО ВИДА НАВЕСКОЙ БОЛЕЕ 5-ти кг. – 400 р/кг.',1,2,5,3,5,656,1,1,'265','2011-08-19 10:41:35','2011-08-19 10:41:35',55.255533518799986,37.872204239700018,2);
insert  into `location_version`(`id`,`name`,`description`,`depth`,`is_free`,`price`,`location_flow_id`,`location_fundus_id`,`location_relief_id`,`location_type_id`,`location_scope_id`,`address_id`,`created_by`,`updated_by`,`slug`,`created_at`,`updated_at`,`latitude`,`longitude`,`version`) values (696,'База отдыха «Щукино» на Волге','аза отдыха «ЩУКИНО» расположена в Воротынском районе 130км от Н.Новгорода по Борской стороне на левом берегу Волги на окраине села Каменка. Эта местность с незапамятных времен славится среди рыбаков и просто отдыхающих, своими неповторимыми заводями, протоками и островами, изобилующими рыбой и птицей.\n \nРазмещение в двух этажном корпусе, в комфортабельных двухместных номерах с туалетом и душем. На базе организовано качественное 3-х разовое питание, входящее в стоимость проживания. Представлены русская, европейская и восточная кухни, способные удовлетворить самые изысканные пристрастия отдыхающих, так же наш повар приготовит для вас блюда по индивидуальному заказу.',NULL,0,'Цена отдыха за сутки с одного отдыхающего (с учетом трехразового питания ):\nНомера 	В будние дни 	В выходные дни\nДвухместный номер (первый этаж) 	1200 рублей 	1600 рублей\nДвухместный номер (второй этаж) 	1400 рублей 	1800 рублей\nНомера класса люкс (сдается как двухместный номер) 	3600 рублей 	5000 рублей\n\n \n\n \n\n \n\n \n\n \n\n \n\nПримечание: Будние дни – с понедельника до 15 часов пятницы. Выходные дни – с 17 часов пятницы по 15 часов понедельника.\n\nУслуги русской бани:\n  	Будние дни 	Пятница 	Суббота 	Воскресенье\nЦена за 1 час, руб. 	500 	800 	1000 	500\n\n \n\n\n\nНа базе отдыха «Щукино» для отдыхающих приготовлено:\n\n   1. 18 двухместных номеров\n   2. Два номера люкс (двухкомнатные)\n',NULL,NULL,NULL,1,5,NULL,1,1,'274','2011-08-19 11:07:15','2011-08-19 11:07:15',56.175292002799999,45.567333157300027,1);
