insert  into `profit`(`id`,`name`,`location_id`,`date`,`cordage`,`description`,`fish_id`,`weight`,`created_at`,`updated_at`,`created_by`,`updated_by`) values (10,'Отсорожно в Острожном',773,'2011-09-02','\r\n','\r\n<p>Ну вот значит и от меня небольшой отчётик! Сидел я значит вчера на работе сидел значит сидел и пришла в голову мысль а почему бы и не сьездить по рыбку-то! позвонил папику и ещё одному своему знакомому и через полтора часа мы на озере. Народу не очень много было человек20 отправились мы сразу целенаправленно к троснику на мель ближе к ручью ( кто был тот знает о чём говорю) проводка вторая....десятая потехоньку полегоньку начали наши запасы пополняться но забегая вперёд скажу ,чо не айс . Ближе к вечеру была у меня поклёвка - подсечка -задёргалось на том конце лески в итоге ОП только и мелькнул большой уже жёлтый бок. Чють позже мною был изловлен подлещщик примерно грамм на 200-250 у батяньки к вечеру окунёк не плохой повис тоже около того а в остальном мелочь.Ну вобщем мной было нежарено вечером дома 3 сковородки поели с удовольствием .А по улову так никто и ничего особого и не поймал да и клевало неохти в минувшее воскресенье и то я больше наловил. Вот!!!!</p>',65,0.25,'2011-09-02 05:56:23','2011-09-02 05:56:23',231,231);
insert  into `profit`(`id`,`name`,`location_id`,`date`,`cordage`,`description`,`fish_id`,`weight`,`created_at`,`updated_at`,`created_by`,`updated_by`) values (11,'Заезд в Ферзиково',776,'2011-05-24','\r\n<p>Приокормки кукуруза,перловка,уникорм&nbsp;. Ловил на донки с кормушками</p>','\r\n<p>В общем поехал на разведку был там в 5-00 народ стоит с ночи да и приехало с утра машин 10.Поехал потому что дошол слух что данный водоем бесплатный это неправда рыбалка стоит 500 ре зорька как сказала мне хозяйка .О рыбалке сразу начала брать плотва на перловку были установлены донки с кормушками результат сразу карп около кило по слухам карп берет прям с берега на кукурузу д кстаи плотва мешает ловить на фидеры клюет на все кукурузу перловку .Через некоторое время у соседа справа уплыла удочка но увы рыба сошла .Ловили на перловку кукурузу мешал уникорм сенсанс недобавлял а зря вообщем на данном водоеме рыбы много</p>',4,0.90,'2011-05-25 05:00:06','2011-05-25 05:00:06',148,148);
