insert  into `talk`(`id`,`name`,`message`,`talk_section_id`,`created_by`,`updated_by`,`created_at`,`updated_at`) values (1,'Мотор на Уфимку - 21','<p>Есть Уфимка - 21 с надувным дном. Есть желание на нее заполучить електро мотор какие есть варианты?</p>',41,7,7,'2011-06-28 17:26:40','2011-06-28 17:26:40');
insert  into `talk`(`id`,`name`,`message`,`talk_section_id`,`created_by`,`updated_by`,`created_at`,`updated_at`) values (2,'как вы спининги покупаете','\r\n<p><span>Уважаемые</span>как вы спиннинги себе выбираете?</p>\r\n<p>можно начитаться интернета и купить-можно в магазине посмотреть и купить</p>\r\n<p>а можно у кого то взять попробовать и потом купить, если понравитьсявопрос возник, так как хочу купить спиннинг и почти выбрал, виртуально, но вчера был на выставке и понял, что смотреть, трясти это все ерунда.мои старые Black Panther трясутся и выглядят не хуже чем те которые по 200 евро.смотрел SpeedMaster но не убедил он меня.самое правильное на воде испытать, но это не всегда возможно.</p>',23,61,61,'2011-04-17 20:41:10','2011-04-17 20:41:10');
insert  into `talk`(`id`,`name`,`message`,`talk_section_id`,`created_by`,`updated_by`,`created_at`,`updated_at`) values (3,'Ловля мирных рыб на ульралайт ','\r\n<p>Прочитал в журнале Рыболов статью о ловле мирной рыбы ультралайтом(плотва,густера,краснопер и тд.) на микроджиговые приманки.У кого есть опыт в подобной рыбалке,просьба поделиться соображениями.Спасибо</p>',23,129,129,'2011-07-12 17:29:00','2011-07-12 17:29:00');
insert  into `talk`(`id`,`name`,`message`,`talk_section_id`,`created_by`,`updated_by`,`created_at`,`updated_at`) values (4,'Катушка для ультралайта','\r\n<p><b>Хотелось бы услышать мненыя рыбаков, по поводу катушек для ультралайтов!&nbsp;</b></p>\r\n<p> Ответы прошу выкладывать по такой схеме:</p><b>1. Спининг</b>\r\n<p> (строй, модель, вес)</p><b>2. Катушка </b>\r\n<p>(модель, вес)</p>\r\n<p> Хочу прикупить себе улик (вес 75 грам), и не знаю какую катуху к нему купить! (интересують бюджетные модели)</p>',23,169,169,'2011-06-09 17:11:45','2011-06-09 17:11:45');
insert  into `talk`(`id`,`name`,`message`,`talk_section_id`,`created_by`,`updated_by`,`created_at`,`updated_at`) values (5,'Шнур','\r\n<p>Колеги , прошу простить меня но посмотрел разные темы о шнурах , отметил много для себя полезного, типы узлов... Вопрос вот в чем: а как привязать эту плетенку к шпуле. Простите начинающему спинингисту.</p>',23,113,113,'2011-06-12 21:00:19','2011-06-12 21:00:19');
insert  into `talk`(`id`,`name`,`message`,`talk_section_id`,`created_by`,`updated_by`,`created_at`,`updated_at`) values (6,'поводка-флюрокарбон','\r\n<p><span>в место стального поводка- флюрокарбон кто нибуть пользовал?</span>щука говорят не режет и судак уверенно берет!</p>',23,166,166,'2011-05-31 01:10:38','2011-05-31 01:10:38');
insert  into `talk`(`id`,`name`,`message`,`talk_section_id`,`created_by`,`updated_by`,`created_at`,`updated_at`) values (7,'Rapala. Подскажите или давайте обсудим. ','\r\n<p><span>Не для кого не секрет, что Rapala - один из лидеров в производстве воблеров.</span></p>\r\n<p> Интересны Ваши мнения об их продукции, на сколько уловисты модельки воблеров. \r\n<br> Себе пока взял следующие: \r\n<br> -- Rapala JSR (Jointed Shad Rap), 7 см, цвет: голубая спинка, оранжевое брюшко. Сколько ни тягал его, даже поклёвки не видел. \r\n<br> -- Rapala XR (X-Rap), 10 см, расцветка \"клоун\", пока не полоскал в воде.</p>\r\n<p> По отзывам отличные вещи, но я пока этого к сожалению не прочувствовал.</p>\r\n<p> Может кто что подскажет, посоветует уловистые модельки или переубедит в том, что стоит акцентировать своё внимание на других производителях. Спасибо.</p>',24,47,47,'2011-08-05 17:48:24','2011-08-05 17:48:24');
insert  into `talk`(`id`,`name`,`message`,`talk_section_id`,`created_by`,`updated_by`,`created_at`,`updated_at`) values (8,'Воблеры ZipBaits','\r\n<p><b>Воблеры ZipBaits</b><span>&nbsp;</span><span>- Наверное одни из самых дорогих воблеров представленых на нашем рынке и последнее время у всех на слуху. Пользователи надеюсь выложат фото своих коллекций с подробным описанием проводок и свойств, а я пока определяюсь стоят ли они таких денег.</span></p>',24,40,40,'2011-09-08 18:56:05','2011-09-08 18:56:05');
insert  into `talk`(`id`,`name`,`message`,`talk_section_id`,`created_by`,`updated_by`,`created_at`,`updated_at`) values (9,'Что такое drop-shot и с чем его едят ','\r\n<p>drop-shot - уловистая снасть для судака и окуня. очень ефективна там где много зацепов и при каждом забросе джыга есть зацеп, а drop-shot позволяет ловить рыбу даже в таких высокозацепистых местах и очень результативно. Так вот кто- что знает о drop-shot/ какие катушки используете? что лутше моно леска лилже плетенка? какие оснастки предпочитаете для этого вида ловли???</p>',24,102,102,'2011-03-05 00:52:29','2011-03-05 00:52:29');
insert  into `talk`(`id`,`name`,`message`,`talk_section_id`,`created_by`,`updated_by`,`created_at`,`updated_at`) values (10,'Фидерние катушки','\r\n<p><span>Ребята собираюсь приобрести новую фидерную катушку CORMORAN MASTER FEEDER - 6Pi, кто пользовалса даной моделью подскажите вещь нормальная или не стоит выбрасивать деньги на ветер. Можна какую нибудь другую модель в ценовом диапазоне до 350 гр.</span></p>\r\n<p> Спасиба!!</p>',25,210,210,'2011-08-12 22:09:21','2011-08-12 22:09:21');
insert  into `talk`(`id`,`name`,`message`,`talk_section_id`,`created_by`,`updated_by`,`created_at`,`updated_at`) values (11,'Спортивный фидер','\r\n<p><span>Предлагаю в этой теме делиться опытом фидерной ловли (снасти, прикормки, места ловли и прочие нюансы).</span></p>\r\n<p> Сам ловлю на фидер два года. Начинал с теории - прочитал множество статей о ловле на фидер, просмотрел множество фильмов и телепередач на эту же тему. Приобрёл недорогой фидер, катушку, леску и прочие аксессуары. За время ловли накопил некоторый опыт. \r\n<br> 1. Удилище. У меня удилище 330 см длиной с тестом до 90 грамм. Реальный тест около 120-130 грамм (кормушка 60 грамм + дополнительный груз 50 грамм + прикормка). Можно и больше, но страшновато. Длина удилища 330-360 см - самая приемлемая, т.к. при большей длине понадобится много чистого пространства позади рыболова для заброса, что не везде есть (обычно за спиной при ловле обрыв или кусты). По поводу материала самого бланка думаю, что особой разницы между стеклом и IM-... (кроме веса самого удилища) для процесса ловли нет, т.к. чуствительность в руку ненужна, а вес удилища некритичен - в любом случае нужно пользоваться подставками. \r\n<br> 2. Катушка. Обычная безинерционная с передаточным числом 5,2:1. Понял, что нужно приобрести либо специализированную (тяговую, с бейтранером), либо покупать дешёвые катушки (которые не жалко выбросить после 2-3 месяцев ловли). Всё дело в том, что при вываживании на катушку приходится большая нагрузка (вес груза+сила течения+сопротивление улова) и обычные катушки просто ломаются. \r\n<br> 3. Леска. Изначально, по совету продавца в магазине, приобрёл дорогую тонущую леску 0,28, через некоторое время заменил её на обычную того же диаметра (в 2 раза дешевле) - никакой существенной разницы в процессе ловли не заметил. В этом сезоне вместо лески будет шнур, думаю улучшится чуствительность и уменьшится парусность на течении (диаметр шнура 0,13) - время покажет. \r\n<br> 4. Аксессуары (кормушки, противозакручиватели, крючки). \r\n<br> Кормушки использую только металлические открытые с двух сторон. Супердешёвые кормушки лучше не брать - очень часто от них отрывается ушко (которым кормушка крепится к остальной снасти) и кормушка просто улетает в воду. Так же не беру пластиковые кормушки (почему то они мне просто не нравятся). По весу - от 30 грамм до 60, в зависимости от условий ловли. Когда веса кормушки не хватает для удержания снасти на дне, то вместе с кормушкой креплю дополнительный груз. \r\n<br> Противозакручиватели (далее назову трубка) - изогнутые пластиковые трубки с застежкой для крепления кормушки/груза использую только с проволочным креплением застёжки к трубке. Есть ещё трубки с пластиковым креплением застежки, но это крепление может соскользнуть с трубки во время заброса и оборвёт при этом крючок или всю снасть. \r\n<br> Одно время вместо трубок использовал т.н. \"нессиметричную петлю\" - вид фидерной оснастки, самостоятельно связанный из лески. Реальных преймуществ такой оснастки перед трубкой не увидел и поэтому отказался. \r\n<br> Размер крючков подбираю исходя из размеров предполагаемых трофеев и размера наживки, особых проблем здесь не вижу. \r\n<br> 5. Прикормка. Использую готовую прикормку \"Фишка\", которую перемешиваю либо со сваренным пшеном, либо с запаренным геркулесом. В первый час ловли кормушку заполняю перед каждым забросом, потом через 1-2 раза. Если течение сильное, то заполняю кормушку перед каждым забросом. \r\n<br> 6. Различные полезные штуки, облегчающие и делающие приятной ловлю. \r\n<br> Обязательно при ловле на фидер имею следущие вещи: \r\n<br> - подставку под фидер \r\n<br> - складной стульчик \r\n<br> - солнцезащитные очки.</p>\r\n<p> Вот пока и всё.Предлагаю в этой теме делиться опытом фидерной ловли (снасти, прикормки, места ловли и прочие нюансы).</p>\r\n<p> Сам ловлю на фидер два года. Начинал с теории - прочитал множество статей о ловле на фидер, просмотрел множество фильмов и телепередач на эту же тему. Приобрёл недорогой фидер, катушку, леску и прочие аксессуары. За время ловли накопил некоторый опыт. \r\n<br> 1. Удилище. У меня удилище 330 см длиной с тестом до 90 грамм. Реальный тест около 120-130 грамм (кормушка 60 грамм + дополнительный груз 50 грамм + прикормка). Можно и больше, но страшновато. Длина удилища 330-360 см - самая приемлемая, т.к. при большей длине понадобится много чистого пространства позади рыболова для заброса, что не везде есть (обычно за спиной при ловле обрыв или кусты). По поводу материала самого бланка думаю, что особой разницы между стеклом и IM-... (кроме веса самого удилища) для процесса ловли нет, т.к. чуствительность в руку ненужна, а вес удилища некритичен - в любом случае нужно пользоваться подставками. \r\n<br> 2. Катушка. Обычная безинерционная с передаточным числом 5,2:1. Понял, что нужно приобрести либо специализированную (тяговую, с бейтранером), либо покупать дешёвые катушки (которые не жалко выбросить после 2-3 месяцев ловли). Всё дело в том, что при вываживании на катушку приходится большая нагрузка (вес груза+сила течения+сопротивление улова) и обычные катушки просто ломаются. \r\n<br> 3. Леска. Изначально, по совету продавца в магазине, приобрёл дорогую тонущую леску 0,28, через некоторое время заменил её на обычную того же диаметра (в 2 раза дешевле) - никакой существенной разницы в процессе ловли не заметил. В этом сезоне вместо лески будет шнур, думаю улучшится чуствительность и уменьшится парусность на течении (диаметр шнура 0,13) - время покажет. \r\n<br> 4. Аксессуары (кормушки, противозакручиватели, крючки). \r\n<br> Кормушки использую только металлические открытые с двух сторон. Супердешёвые кормушки лучше не брать - очень часто от них отрывается ушко (которым кормушка крепится к остальной снасти) и кормушка просто улетает в воду. Так же не беру пластиковые кормушки (почему то они мне просто не нравятся). По весу - от 30 грамм до 60, в зависимости от условий ловли. Когда веса кормушки не хватает для удержания снасти на дне, то вместе с кормушкой креплю дополнительный груз. \r\n<br> Противозакручиватели (далее назову трубка) - изогнутые пластиковые трубки с застежкой для крепления кормушки/груза использую только с проволочным креплением застёжки к трубке. Есть ещё трубки с пластиковым креплением застежки, но это крепление может соскользнуть с трубки во время заброса и оборвёт при этом крючок или всю снасть. \r\n<br> Одно время вместо трубок использовал т.н. \"нессиметричную петлю\" - вид фидерной оснастки, самостоятельно связанный из лески. Реальных преймуществ такой оснастки перед трубкой не увидел и поэтому отказался. \r\n<br> Размер крючков подбираю исходя из размеров предполагаемых трофеев и размера наживки, особых проблем здесь не вижу. \r\n<br> 5. Прикормка. Использую готовую прикормку \"Фишка\", которую перемешиваю либо со сваренным пшеном, либо с запаренным геркулесом. В первый час ловли кормушку заполняю перед каждым забросом, потом через 1-2 раза. Если течение сильное, то заполняю кормушку перед каждым забросом. \r\n<br> 6. Различные полезные штуки, облегчающие и делающие приятной ловлю. \r\n<br> Обязательно при ловле на фидер имею следущие вещи: \r\n<br> - подставку под фидер \r\n<br> - складной стульчик \r\n<br> - солнцезащитные очки.</p>\r\n<p> Вот пока и всё.</p>',25,237,237,'2011-08-02 07:44:26','2011-08-02 07:44:26');
insert  into `talk`(`id`,`name`,`message`,`talk_section_id`,`created_by`,`updated_by`,`created_at`,`updated_at`) values (12,'Какие крючки для фидера пользуем? ','\r\n<p><span>Вопрос собственно возник по крючкам KAMATSU KAIZU.Просто удивила сама форма крючка и объяснения продовца - это самоподсекающий крюк.Информации в сети не нашел.На родном сайте Kamatsu толкового тоже не написано.</span></p>\r\n<p> Может кто такие (не обязательно Kamatsu главное форма) использовал или пользует.Пусть поделиться впечатлениями. Да и вообще интересно кто какие крючки пользует и почему.Опять же вопрос возник после изучения крючков Kamatsu. К примеру я узнал что крючки MARUSEIGO специально созданы для растительных насадок(кукуруза,горох ...),тесто . \r\n<br> Так что колитесь!</p>',25,301,301,'2011-08-16 03:58:19','2011-08-16 03:58:19');
insert  into `talk`(`id`,`name`,`message`,`talk_section_id`,`created_by`,`updated_by`,`created_at`,`updated_at`) values (13,'Недорогие снасти для ловли мирной рыбы. ','\r\n<p><span>Коллеги!</span></p>\r\n<p> Предлагаю создать тему, в которой обсудить недорогие катушки, удилища, нитку и т.д. исходя из опыта применения. Все мы знаем, что хорошие катушки - это дайва, шекспир, абу гасия, и так далее, но стоимость этих катушек, как и остальных снастей известных производителей, весьма и весьма высокая. Далеко не каждый из нас имеет пару нефтяных вышек, позволяющих спокойно покупать катушки за 300-500 долларов, зато большинство из нас имеет семьи, детей, которые любят мороженное, жен, мечтающих о новых тряпках, и престарелых родителей, которым тоже хочется дать какую то копейку, пенсии Азаров платит мизерные.\r\n<br> Поэтому предлагаю обсуждать в этой теме недорогие но качественные снасти, отрабатывающие те деньги, которые они стоят с лихвой. \r\n<br> В качестве примера хочу привести китайскую катушку фирмы \"Линия волка\". Катушка Eugene 3000, простая, дешевая, имеет 4 подшипника, нормально реагирует на песок, не клинит, короче никаких претензий. Вполне имеет право быть использована для ловли на фидер. Мой приятель уже 5 год пытается убить эти катушки, не чистит их, с удилищ не снимает, краска облезла почти вся, а катушки работают исправно. Причем таскает он ими кормушки по 150 граммов.\r\n<br> Думаю, можно рекомендовать этого производителя для тех, кто или только начинает рыбачить или не имеет возможности или попросту не хочет платить большие деньги за фирменные вещи. \r\n<br> Что скажете?</p>',25,162,162,'2011-08-26 07:15:54','2011-08-26 07:15:54');
insert  into `talk`(`id`,`name`,`message`,`talk_section_id`,`created_by`,`updated_by`,`created_at`,`updated_at`) values (14,'Домашня прикормка на карпа','\r\n<p>Я много лет люблю ловить карпа, и сам уже давно хорошо ловлю карпа в черте города на бойлы. Но когда я уезджаю к бабули в село, то на прудах ловить на бойлы не ефективно, там карп прывык к естественным насадкам, кукурудза, горох, червяк, тесто, хлеб и главная насадка мясо молюсков. Но и прикормку надо использывать что надо, и правильно подобрать к насадки, может кто-то из вас знакомый с такими водоемами где прикормку надо подбирать в сочетании с насадкой, например если ловить на кукурудзу, то в прикормке для такой ловли должно быть много крупных фракцый, чучуть кукурудзы, и поменьше мелких компонентов, некоторые рыболовы прикармливают токо тем на что ловят, а правильно ли ето? Пробывал прикармливать спецыальной карповой прикормкой \"Флешка\"- Карп, но ефективного результату она не дала, токо согнала мелоч со всего водоема, а карпа так и не было, что-ж ето получается, фирменые прикормки делают под подбор к городским водоемам, а что делать рыболову когда он приехал на водоем и куплиные прикормки в магазине не работают, то надо подобрать и зделать прикормку к водоему по его характеристикам</p>',26,35,35,'2011-02-18 19:34:39','2011-02-18 19:34:39');
insert  into `talk`(`id`,`name`,`message`,`talk_section_id`,`created_by`,`updated_by`,`created_at`,`updated_at`) values (15,'Бойлы и все что с ними связано... ','\r\n<p><span>Бйлы прежде всего есть основным видом как насадки так и прикормки любого карпятника.Они бывают всевозможных размеров,цветов и запахов.Особенно карп не брезгует бойлами с запахом конопли.Для етого придется или самому собирать семена етого чудо-растения или же купить готовые бойлы,еще можно найти ароматизатор.</span></p>\r\n<p> Очень хорошо себя зарекомендовала так званая ловля на Бутерброды-использывание нескольких насадок одновременно,например одна очень удачная комбинация:опарышь+кукуруза.\r\n<br> Также хорошо использывать в качестве прикормки бойли 1 расцветки а наживочный бойл другой расцветки,скажем более яркой чем прикормочный бойл.</p>\r\n<p> Зы:предлагаю всем желающим делится своим опытом ловли на ети Чудо бойлы,возможно говорить о тех или иных производителях которые есть найлучшимив етом виде привад и т.д и т.п...</p>',26,155,155,'2011-09-27 07:05:43','2011-09-27 07:05:43');
insert  into `talk`(`id`,`name`,`message`,`talk_section_id`,`created_by`,`updated_by`,`created_at`,`updated_at`) values (16,'Как выставить глубину на поплавчанке?','\r\nВсем привет. Я начинающий рыболов, ловлю на маховую удочку и у меня вопрос, как правильно выставить глубину, должен ли грузик касаться дна или на дне должен лежать только крючок и какой длины должны быть поводки?\r\nЗаранее спасибо!',28,208,208,'2011-08-11 14:04:57','2011-08-11 14:04:57');
insert  into `talk`(`id`,`name`,`message`,`talk_section_id`,`created_by`,`updated_by`,`created_at`,`updated_at`) values (17,'Ловля карася на поплавок ','\r\n<p><span>Подходящей темы не нашол, так давайте поговорим о ловле етой прекрасной рыбке Карась</span><span>, все о снастях, прикормке, насадки и маленьких хитростях</span></p>',28,35,35,'2011-02-07 12:01:56','2011-02-07 12:01:56');
insert  into `talk`(`id`,`name`,`message`,`talk_section_id`,`created_by`,`updated_by`,`created_at`,`updated_at`) values (18,'Краснопёрка на поплавок ','\r\n<p>Очень люблю красноперку, особенно вяленую к пиву, да и так рыбка неплохая, хоть не сильно крупная. Кто что знает о её ловле, поделитесь.</p>',28,243,243,'2011-09-13 20:35:53','2011-09-13 20:35:53');
insert  into `talk`(`id`,`name`,`message`,`talk_section_id`,`created_by`,`updated_by`,`created_at`,`updated_at`) values (19,'Маховое удилище ','\r\n<p><span>Сравнивал маховые шестерки разных фирм: Shimano, Trabucco, Flagman. Купил маховое Surf Master Heroic 1606. Ловить пока не пробовал.&nbsp;</span></p>\r\n<p> Хотелось бы получить больше информации о фирме Surf Master и о линейке маховых удилищ Heroic. Может кто держал в руках этот прут, может кто-то пробовал? Какие отзывы? </p>\r\n<p> Заранее спасибо.</p>',28,238,238,'2011-10-02 19:44:49','2011-10-02 19:44:49');
insert  into `talk`(`id`,`name`,`message`,`talk_section_id`,`created_by`,`updated_by`,`created_at`,`updated_at`) values (20,'Посоветуйте недорогой эхолот.','\r\n<p>Всем доброго времени суток. Хочу приобрести эхолот, данным прибором никогда не пользовался и отсюда много вопросов. Подскажите плзю фирма, параметры, что брать а что не стоит. Но хочу 2 луча. Денег 10-15 тыс. Всем спасибо за ответы</p>',43,320,320,'2011-09-27 08:35:10','2011-09-27 08:35:10');
insert  into `talk`(`id`,`name`,`message`,`talk_section_id`,`created_by`,`updated_by`,`created_at`,`updated_at`) values (21,'Подскажите какой навигатор купить. ','\r\n<p><span>Всем привет решил купить навигатор для авто. В этом совсем не смыслю, надеюсь тут получить помощь.&nbsp;</span></p>\r\n<p> Мне нужен в пределах 6000 руб. Выбора очень много, но хочу такой что бы потом не возникало проблем с загрузкой карт и прошивки (хочу сам прошивать и записывать карты ))).) Ну соответственно что бы было максимально функций за эту сумму.</p>\r\n<p> P.S. И конечно ссылку на данный девайс и инструкцию по апгрейду навигаторов (конечно же если можно)</p>',43,249,249,'2011-10-04 11:16:02','2011-10-04 11:16:02');
